CREATE OR REPLACE
TRIGGER ctrl_validacion_no_aplicacion
 before update of FECHA_VALIDACION, ID_OPER_VALIDA 
 on ccg_cert_no_aplicacion
 for each row
 DECLARE
   tipo NUMBER;
 begin
  begin
    select idtipo_operador into tipo from reg_operadores where idoperador= :new.ID_OPER_VALIDA;
    if tipo=3 then
      :new.ID_OPER_VALIDA:=null;
      :new.FECHA_VALIDACION:=null;
    end if;
  exception
  WHEN NO_DATA_FOUND
         THEN
         DBMS_OUTPUT.put_line ('No hay datos');
  end;
 end;

