CREATE OR REPLACE
TRIGGER CREAR_JOB_NOPRES 
AFTER INSERT ON DDJJ_VENCIMIENTOS 
FOR EACH ROW
declare
      job int;
BEGIN
     dbms_job.submit (
        job       => job,
        what      => 'begin PRD_GENERAR_NOPRES(''' || :new.PERIODO || '''); end;',
        next_date => trunc(:new.VENCIMIENTO)+1
      );

END;

CREATE OR REPLACE
TRIGGER "SIYM"."HABILITAR_OPERADOR_MULTA" 
   AFTER UPDATE OF boleta
   ON siym.exp_nota_fuera
   REFERENCING OLD AS old_value NEW AS new_value
   FOR EACH ROW
--WHEN (old_value.boleta != new_value.boleta)
DECLARE
   p_motivo               NUMBER;
   p_idusuario_habilita   NUMBER;
   ejecutar               BOOLEAN;
   msj_error              VARCHAR2 (200);
BEGIN
   ejecutar := TRUE;
   msj_error := '';
   DBMS_OUTPUT.put_line ('TRIGGER HABILITAR OPERADOR: ' || :new_value.boleta);

   IF (:new_value.boleta > 0 OR :new_value.boleta <> NULL)
   THEN
      BEGIN
         msj_error := 'NO ENCUENTRA USUARIO QUE HABILITA';

         SELECT user_id
           INTO p_idusuario_habilita
           FROM user_users;

         msj_error :=
            'NO ENCUENTRA EL REGISTRO EN REG_INHABILITACIONES CON IDMOTIVO = 4';

         SELECT motivo
           INTO p_motivo
           FROM siym.reg_inhabilitaciones
          WHERE idoperador = :old_value.idoperador
            AND periodo = :old_value.periodo
            AND idmotivo_inhab = 4;
      EXCEPTION
         WHEN NO_DATA_FOUND
         THEN
            ejecutar := FALSE;
            DBMS_OUTPUT.put_line (msj_error || SQLCODE || ' ** ' || SQLERRM);
         WHEN OTHERS
         THEN
            ejecutar := FALSE;
            DBMS_OUTPUT.put_line (msj_error || SQLCODE || ' ** ' || SQLERRM);
      END;

      IF (ejecutar = TRUE)
      THEN
         DBMS_OUTPUT.put_line ('IDOPERADOR: ' || :old_value.idoperador);
         DBMS_OUTPUT.put_line ('PERIODO: ' || :old_value.periodo);
         DBMS_OUTPUT.put_line ('MOTIVO: ' || p_motivo);
         siym.prd_inhabilitaciones (4,
                                    :old_value.idoperador,
                                    TO_CHAR (:old_value.periodo, 'yyyy-mm-dd'),
                                    p_motivo,
                                    p_idusuario_habilita,
                                    'U'
                                   );
      END IF;
   END IF;
END;

