CREATE OR REPLACE PROCEDURE ACT_RESTO_EST_MUESTRAS (p_idusuario NUMBER) AS

    v_idusuario NUMBER;
    v_letra VARCHAR2(3);    
    v_numero NUMBER;
    v_resto NUMBER;
    v_nfinal NUMBER;

    CURSOR v_obj_muestras
    IS
    SELECT 
    MD.IDMUESTRA_DETALLE,
    MD.BUSQUEDA,
    MD.LINICIAL,
    MD.LFINAL,
    MD.NFINAL,
    MD.NINICIAL
    FROM SIYM.EST_MUESTRAS_DETALLES MD;    

BEGIN
    DBMS_OUTPUT.ENABLE;
    FOR fila_muestra IN v_obj_muestras
      LOOP

          v_numero := TO_NUMBER(SUBSTR(fila_muestra.BUSQUEDA,6));
          v_letra := SUBSTR(fila_muestra.BUSQUEDA,3, 3);
          v_nfinal := TO_NUMBER(fila_muestra.NFINAL);

          IF(fila_muestra.LINICIAL <> fila_muestra.LFINAL) THEN
            IF(v_letra = fila_muestra.LINICIAL) THEN
                v_resto := v_nfinal + (99999 - v_numero);
            ELSE            
                v_resto := v_nfinal - v_numero;
            END IF;

          ELSE            
            v_resto := v_nfinal - v_numero;
          END IF;

          DBMS_OUTPUT.put_line(
            'BUSQUEDA: ' || fila_muestra.BUSQUEDA || ' NUMERO: '|| TO_NUMBER(SUBSTR(fila_muestra.BUSQUEDA,6))
            || ' LETRA: '|| SUBSTR(fila_muestra.BUSQUEDA,3, 3) || ' RANGO BOBINA: ' || fila_muestra.NINICIAL || ' - ' || fila_muestra.NFINAL ||' ('|| fila_muestra.LINICIAL || '-' || fila_muestra.LFINAL ||') ' || ' RESTO: '|| v_resto
          );

          --UPDATE SIYM.EST_MUESTRAS_DETALLES SET RESTO=v_resto WHERE SIYM.EST_MUESTRAS_DETALLES.IDMUESTRA_DETALLE=fila_muestra.IDMUESTRA_DETALLE;

      END
    LOOP;     

END ACT_RESTO_EST_MUESTRAS;

CREATE OR REPLACE PROCEDURE PRD_CCG_CREDITO_REING_YMC 


 AS 
    v_idoper    siym.ddjj_ingresos.idoperador%TYPE;
    v_periodo   siym.ddjj_ingresos.periodo%TYPE;
    v_inymn     siym.ddjj_ingresos.inymn%TYPE;
    v_ing_ymc   siym.ddjj_ingresos.kilos%TYPE;
    v_sal_ymc   siym.ddjj_ingresos.kilos%TYPE;
    v_conta     NUMBER;

   /* Primer Cursor */


    CURSOR cur_nivel_1 IS
    SELECT
        ddjj$_total_ing_ym.idoperador,
        ddjj$_total_ing_ym.inymn,
        SUM(ddjj$_total_ing_ym.kilos) AS ing_ymc,
        nvl((
            SELECT
                SUM(ddjj$_total_sal_ym.kilos) sal
            FROM
                siym.ddjj$_total_sal_ym
            WHERE
                ddjj$_total_sal_ym.idoperador = ddjj$_total_ing_ym.inymn
                AND ddjj$_total_sal_ym.periodo = ddjj$_total_ing_ym.periodo
                AND ddjj$_total_sal_ym.inymn = ddjj$_total_ing_ym.idoperador
                AND ddjj$_total_sal_ym.idestado_yerba = 2
        ), 0) sal_ymc
    FROM
        siym.ddjj$_total_ing_ym
        INNER JOIN siym.reg$_operadores2 ON reg$_operadores2.idoperador = ddjj$_total_ing_ym.inymn
    WHERE
        ddjj$_total_ing_ym.periodo = add_months(trunc(sysdate,'MONTH'),-2)
        AND ddjj$_total_ing_ym.idestado_yerba = 2
        AND reg$_operadores2.idtipo_operador IN (
            9,
            10
        )
        AND ddjj$_total_ing_ym.idtipo_operador IN (
            2,
            3,
            5
        )
    GROUP BY
        ddjj$_total_ing_ym.idoperador,
        ddjj$_total_ing_ym.periodo,
        ddjj$_total_ing_ym.inymn;

BEGIN   
    v_periodo:= add_months(trunc(sysdate,'MONTH'),-2);  
   /* Primer Cursor */
    OPEN cur_nivel_1;
    LOOP
        FETCH cur_nivel_1 INTO
            v_idoper,
            v_inymn,
            v_ing_ymc,
            v_sal_ymc;
        EXIT WHEN cur_nivel_1%notfound;

        BEGIN
            SELECT
                siym.ccg_creditos.kilos into v_conta
            FROM
                siym.ccg_creditos
            WHERE
                siym.ccg_creditos.idoperador = v_idoper
                AND siym.ccg_creditos.periodo = v_periodo
                AND siym.ccg_creditos.idtipo_credito = 5;

        EXCEPTION
            WHEN no_data_found THEN
                v_conta := 0;
        END;

        IF v_conta = 0 THEN
            IF v_ing_ymc >= (v_sal_ymc * 0.95) AND v_ing_ymc <= (v_sal_ymc * 1.05) THEN
                INSERT INTO CCG_CREDITOS (IDCREDITO,IDOPERADOR,PERIODO,FECHA,IDTIPO_CREDITO,KILOS) 
                VALUES(SIYM.CCG_CREDITOS_SEQ.NEXTVAL,
                       v_idoper,
                       v_periodo,
                       SYSDATE,
                       5,
                       v_ing_ymc);

                dbms_output.put_line('insert ' || v_idoper);
            END IF;
        ELSIF v_conta <> v_ing_ymc THEN
            UPDATE siym.ccg_creditos
            SET kilos = v_ing_ymc
            WHERE idoperador = v_idoper
            AND periodo = v_periodo
            AND idtipo_credito = 5;

            dbms_output.put_line('update ' || v_idoper); 
        ELSE
            dbms_output.put_line('no update/insert ' || v_idoper); 
        END IF;

    END LOOP;

    CLOSE cur_nivel_1; 
    dbms_output.put_line('fin del procesamiento ');
    COMMIT;
END PRD_CCG_CREDITO_REING_YMC;

CREATE OR REPLACE PROCEDURE PRD_INHAB
AS
  v_fileHandler UTL_FILE.FILE_TYPE;
  v_sql_inhab VARCHAR2(200)                           := 'SELECT IDOPERADOR, TO_CHAR(PERIODO, ''MM-RR''), "CUIT EMPRESA", "TIPO DE OPERADOR", "RAZON / DENOMINACION SOCIAL", "MOTIVO" FROM EXP$_INHABILITADOS';
  excelReport ExcelDocumentType                       := ExcelDocumentType();
  documentArray ExcelDocumentLine                     := ExcelDocumentLine();
  v_worksheet_rec ExcelDocTypeUtils.T_WORKSHEET_DATA  := NULL;
  v_worksheet_array ExcelDocTypeUtils.WORKSHEET_TABLE := ExcelDocTypeUtils.WORKSHEET_TABLE();
  v_sheet_title ExcelDocTypeUtils.T_SHEET_TITLE       := NULL;
  v_style_def ExcelDocTypeUtils.T_STYLE_DEF           := NULL;
  v_style_array ExcelDocTypeUtils.STYLE_LIST          := ExcelDocTypeUtils.STYLE_LIST();

BEGIN



  v_style_def.p_style_id := 'encabezado';
  v_style_array.EXTEND;

  v_style_array(v_style_array.COUNT) := v_style_def;
  v_style_def                        := NULL;
  v_style_def.p_style_id             := 'SheetTitleStyle';
  v_style_def.p_align_horizontal     := 'Center';
  v_style_def.p_bold                 := 'Y';
  v_style_def.p_fsize                := '16';

  v_style_array.EXTEND;
  v_style_array(v_style_array.COUNT) := v_style_def;
  v_sheet_title.title                := 'Listado de inhabilitados';
  v_sheet_title.cell_span            := '6';
  v_sheet_title.style                := 'SheetTitleStyle';

  v_worksheet_rec.title              := v_sheet_title;
  v_worksheet_rec.query              := v_sql_inhab;
  v_worksheet_rec.worksheet_name     := 'inhabilitados';
  v_worksheet_rec.col_count          := 6;
  v_worksheet_rec.col_width_list     := '13,10,12,62,77,13';
  v_worksheet_rec.col_header_list    := 'IDOPERADOR,PERIODO,CUIT,TIPO,DENOMINACION,MOTIVO';
  v_worksheet_rec.col_datatype_list  := 'Number,,Number,String,String,String';

  v_worksheet_rec.col_header_exist  := true;

  --v_worksheet_rec.col_style_list    := ',,,,';
  v_worksheet_array.EXTEND;

  v_worksheet_array(v_worksheet_array.count) := v_worksheet_rec;
  v_worksheet_rec                            := NULL;

  DBMS_OUTPUT.PUT_LINE(v_worksheet_array.count);

  excelReport   := ExcelDocTypeUtils.createExcelDocument(v_worksheet_array,v_style_array);
  documentArray := excelReport.getDocumentData;

  v_fileHandler := UTL_FILE.fopen('INHAB','inhabilitados.xls','W');

  FOR x IN 1 .. documentArray.COUNT
  LOOP
    UTL_FILE.put_line(v_fileHandler,documentArray(x));
  END LOOP;
  UTL_FILE.fclose(v_fileHandler);

  DBMS_SCHEDULER.RUN_JOB('INHAB');
END;

CREATE OR REPLACE PROCEDURE PRD_SVN AS
  v_fileHandler UTL_FILE.FILE_TYPE;
  v_status number;

  --PLANTAS
  CURSOR v_obj_plantas IS
  SELECT 'INSERT INTO ddjj_plantas VALUES('|| idoperador||', '''||provincia||''', '''||departamento||''', '''|| municipio||''', '''|| domicilio||''');\n' AS INSERTINTO
  FROM SIYM.DDJJ$_OPER_PLANTAS
  WHERE SIYM.DDJJ$_OPER_PLANTAS.ALTA IS NOT NULL;

  --DEPOSITOS
  CURSOR v_obj_depositos IS
  SELECT 'INSERT INTO ddjj_depositos VALUES('|| iddeposito||', '||idoperador||', '''|| tipo_deposito||''', '''||provincia||''', '''||departamento||''', '''|| municipio||''', '''|| domicilio||''');\n' AS INSERTINTO
  FROM SIYM.DDJJ$_OPER_DEPOSITOS
  WHERE SIYM.DDJJ$_OPER_DEPOSITOS.ALTA IS NOT NULL;

  --OPERADORES
  CURSOR v_obj_operadores IS
  SELECT 'INSERT INTO ddjj_operadores VALUES('||idoperador||', '|| idtipo_operador||', '|| idempresa||', '|| idpersoneria||', '''|| nom_deno||''', '''||provincia||''', '''||departamento||''', '''|| municipio||''', '''|| domicilio||''');\n' AS INSERTINTO
  FROM SIYM.DDJJ$_OPER_EMPRESAS
  WHERE SIYM.DDJJ$_OPER_EMPRESAS.ALTA IS NOT NULL;

  --MARCAS
  CURSOR v_obj_marcas IS
  SELECT 'INSERT INTO ddjj_marcas VALUES('||idmarca||', '|| idoperador||', '''|| marca||''');\n' AS INSERTINTO
  FROM SIYM.DDJJ$_OPER_MARCAS;

BEGIN
	--PLANTAS
	v_fileHandler := UTL_FILE.FOPEN('SVN', 'LISTADOS-p.sql', 'W');
	FOR fila IN v_obj_plantas LOOP
		UTL_FILE.PUTF(v_fileHandler, fila.INSERTINTO);
	END LOOP;
	UTL_FILE.FCLOSE(v_fileHandler);

	--DEPOSITOS
	v_fileHandler := UTL_FILE.FOPEN('SVN', 'LISTADOS-d.sql', 'W');
	FOR fila IN v_obj_depositos LOOP
		UTL_FILE.PUTF(v_fileHandler, fila.INSERTINTO);
	END LOOP;
	UTL_FILE.FCLOSE(v_fileHandler);

	--OPERADORES
	v_fileHandler := UTL_FILE.FOPEN('SVN', 'LISTADOS-o.sql', 'W');
	FOR fila IN v_obj_operadores LOOP
		UTL_FILE.PUTF(v_fileHandler, fila.INSERTINTO);
	END LOOP;
	UTL_FILE.FCLOSE(v_fileHandler);

	--MARCAS
	v_fileHandler := UTL_FILE.FOPEN('SVN', 'LISTADOS-m.sql', 'W');
	FOR fila IN v_obj_marcas LOOP
		UTL_FILE.PUTF(v_fileHandler, fila.INSERTINTO);
	END LOOP;
	UTL_FILE.FCLOSE(v_fileHandler);

	DBMS_SCHEDULER.RUN_JOB('SVN_LISTADOS');

	EXCEPTION
		WHEN utl_file.invalid_path THEN
			raise_application_error(-20000, 'ERROR: Invalid path for file.');
END;

CREATE OR REPLACE PROCEDURE PRD_CCG_INHAB_NO_PAGO AS 
CURSOR v_obj_liq
  IS
  select distinct l.idoperador, l.nombre--, l.periodo 
  from ccg$_liquidaciones l  where idestado=3 and venc < sysdate
  and l.idoperador not in (select idoperador from REG_INHABILITACIONES_EXTRAS
  where IDMOTIVO_INHAB=10 and FECHA_HABILITACION is null) and idoperador <> 18423;
BEGIN
  FOR fila IN v_obj_liq LOOP
    PRD_INHABILITACIONES(10, fila.IDOPERADOR, null, null, null, 'I');
  END LOOP;
END PRD_CCG_INHAB_NO_PAGO;

CREATE OR REPLACE PROCEDURE PRD_CCG_ACT_BOLETAS AS 
  interes FLOAT;
  total FLOAT;
  CURSOR v_obj_liq
  IS
    select l2.IDOPERADOR, l2.TOTAL, l2.IDBOLETA, l2.NROBOLETA, l2.VENC, (select sum(d.IMPORTE) FROM ccg_liquidaciones l
    inner join CCG_DETALLE_LIQUIDACIONES d on l.IDLIQUIDACION = d.IDLIQUIDACION
    left join CCG_HIST_LIQUIDACIONES h on h.IDLIQUIDACION = d.IDLIQUIDACION and h.IDESTADO=4
    left join INYM_DETALLE_BOLETAS b on h.IDBOLETA = b.IDBOLETA
    where l.IDLIQUIDACION = l2.IDLIQUIDACION and (d.FECHA > h.FECHA OR h.FECHA is null)
    group by idoperador, periodo
    ) IMPORTE from ccg$_liquidaciones l2  where idestado=3 and vencimiento < to_char(sysdate, 'dd/mm/yyyy');
    --select l.* from ccg$_liquidaciones l  where idestado=3 and vencimiento < to_char(sysdate, 'dd/mm/yyyy');
BEGIN

  FOR fila IN v_obj_liq LOOP
    --total:=fila.TOTAL- nvl(fila.IMPORTE_PAGADO,0);
    total:=fila.IMPORTE;
    --interes:=total * ((to_date(to_char(sysdate, 'dd/mm/yyyy'))-fila.venc)*(0.1/100));
    interes:=total * ((to_date(to_char(sysdate, 'dd/mm/yyyy'))-fila.venc)*(0.197000/100));
    update inym_detalle_boletas set fecha_vencimiento=to_date(to_char(sysdate, 'dd/mm/yyyy')), importe = total + interes
    where boleta_nro=fila.nroboleta and idboleta=fila.idboleta;
    --dbms_output.put_line(fila.IDOPERADOR || ' ' || ' ' || fila.TOTAL || ' ' || interes);
  END LOOP;
END PRD_CCG_ACT_BOLETAS;

CREATE OR REPLACE PROCEDURE PRD_3NOPRESENTADAS(
    p_inicio SIYM.ddjj_declaraciones.periodo%TYPE,
    p_fin SIYM.ddjj_declaraciones.periodo%TYPE,
    p_tipo VARCHAR)
AS
  CURSOR v_listado
  is
    SELECT siym.reg$_oper_fechas.idoperador
    from siym.reg$_oper_fechas
    JOIN siym.reg_operadores ON (siym.reg_operadores.idoperador=siym.reg$_oper_fechas.idoperador)
    WHERE siym.reg$_oper_fechas.baja            IS NULL
    AND siym.reg_operadores.idtipo_operador <> 1
    ORDER BY siym.reg$_oper_fechas.idoperador;

  CURSOR v_baja
  IS
    SELECT SIYM.tmp_exp_planilla_baja.idoperador,
      SIYM.tmp_exp_planilla_baja.periodos
    FROM SIYM.tmp_exp_planilla_baja;
  v_meses    varchar(500);
  v_presenta    VARCHAR(2);
  v_cantidad NUMBER;
  v_coma     NUMBER(1);
  v_control  NUMBER(2);
  v_mes SIYM.ddjj_declaraciones.periodo%TYPE;
  v_ddjj siym.ddjj$_oper_declara.fecha_declara%TYPE;
  v_per NUMBER(2);
  --v_alta SIYM.reg_operadores.alta%TYPE;
  v_nro_exp SIYM.exp_expedientes.idexpediente%TYPE;
BEGIN  
  v_cantidad := 0;
  v_control := 0;
  v_coma     := 0;
  v_meses    := '';
  v_presenta := '';
  v_per      := 0;

  IF p_tipo   = 'T' THEN
    DELETE FROM SIYM.tmp_exp_planilla_baja;

    FOR reg IN v_listado LOOP

      BEGIN
        SELECT fecha_declara INTO v_ddjj
        FROM siym.ddjj$_oper_declara
        WHERE idoperador = reg.idoperador;

      EXCEPTION WHEN NO_DATA_FOUND THEN
        v_ddjj := NULL;
      END;

      IF v_ddjj IS NOT NULL AND v_ddjj <= p_fin THEN
        IF v_ddjj < p_inicio THEN
          v_per := 1;
        ELSE
          v_per := TO_NUMBER(TO_CHAR(v_ddjj, 'MM'));
        END IF;
      ELSE
        v_per := 0;
      END IF;

      IF v_per > 0 AND (months_between(p_fin, v_ddjj) + 1) > 2 THEN
        for mes in v_per .. to_number(to_char(p_fin, 'MM')) loop
          select siym.fn_verif_periodo(reg.idoperador, to_char(p_fin, 'YYYY')||'/'||mes||'/01') into v_presenta 
          FROM dual;

          IF v_presenta = 1 THEN
            BEGIN
              SELECT periodo INTO v_mes
              FROM siym.ddjj_declaraciones
              WHERE idoperador = reg.idoperador
              AND periodo      = '01/'||mes||'/'||TO_CHAR(p_fin, 'YYYY')
              AND motivo   = 0;

              EXCEPTION
                WHEN NO_DATA_FOUND THEN
                  IF v_coma  = 1 THEN
                    v_meses := v_meses || ', ' || TRIM(BOTH ' ' FROM TO_CHAR(TO_DATE('01/'||mes||'/'||EXTRACT(YEAR FROM p_fin)), 'Month'));
                  ELSE
                    v_meses := v_meses || TRIM(BOTH ' ' FROM TO_CHAR(TO_DATE('01/'||mes||'/'||EXTRACT(YEAR FROM p_fin)), 'Month'));
                  END IF;

                  v_coma    := 1;
                  v_control := v_control + 1;
            end;
          END IF;
        END LOOP;

        v_meses     := v_meses || ' de ' || TO_CHAR(p_inicio, 'YYYY');
        IF v_control > 2 THEN
          --v_cantidad := v_cantidad + 1;
          --dbms_output.put_line ('Operador nro:'||reg.idoperador);
          --dbms_output.put_line ('Periodo:'||v_control);
          --dbms_output.put_line ('Alta:'||v_alta);

          INSERT INTO SIYM.tmp_exp_planilla_baja
          (idoperador, periodos)
          VALUES (reg.idoperador, v_meses);
        END IF;

        v_meses   := '';
        v_coma    := 0;
        v_control := 0;
        v_per     := 0;
      END IF;
    END LOOP;
  END IF;

  IF p_tipo = 'D' THEN
      INSERT INTO SIYM.exp_planilla_baja
      (idplanilla_baja, fecha)
      VALUES (SIYM.exp_planilla_baja_seq.NEXTVAL || '/' || TO_CHAR(SYSDATE, 'YYYY'), TO_TIMESTAMP(TO_CHAR(SYSDATE,'DD-MM-RRRR'), 'DD-MM-RRRR'));

      FOR reg IN v_baja
      LOOP
        INSERT INTO SIYM.exp_nota_bajas
        (idnota_baja, fecha, idoperador, idplanilla_baja, periodos)
        VALUES (SIYM.exp_nota_bajas_seq.NEXTVAL  || '/' || TO_CHAR(SYSDATE, 'YYYY'), SYSDATE, reg.idoperador, SIYM.exp_planilla_baja_seq.CURRVAL || '/' || TO_CHAR(SYSDATE, 'YYYY'), reg.periodos);

        BEGIN
          SELECT DISTINCT SIYM.exp_hist_expedientes.idexpediente INTO v_nro_exp
          FROM SIYM.exp_expedientes
          INNER JOIN SIYM.exp_hist_expedientes ON (SIYM.exp_hist_expedientes.idexpediente = SIYM.exp_expedientes.idexpediente)
          WHERE SUBSTR("SIYM"."EXP_HIST_EXPEDIENTES"."IDEXPEDIENTE",-4,4)=SUBSTR(reg.periodos,-4,4)
          AND SIYM.exp_expedientes.idtipo_registro     = 1
          AND SIYM.exp_expedientes.registro            = to_char(reg.idoperador)
          AND (SIYM.exp_hist_expedientes.idtipo_escrito = 1
            OR SIYM.exp_hist_expedientes.idtipo_escrito = 2);

          EXCEPTION
            WHEN NO_DATA_FOUND THEN
              BEGIN
                SELECT DISTINCT SIYM.exp_hist_expedientes.idexpediente INTO v_nro_exp
                FROM SIYM.exp_expedientes
                INNER JOIN SIYM.exp_hist_expedientes ON (SIYM.exp_hist_expedientes.idexpediente = SIYM.exp_expedientes.idexpediente)
                WHERE SUBSTR("SIYM"."EXP_HIST_EXPEDIENTES"."IDEXPEDIENTE",-4,4)=EXTRACT(YEAR FROM sysdate)
                AND SIYM.exp_expedientes.idtipo_registro     = 1
                AND SIYM.exp_expedientes.registro            = reg.idoperador
                AND (SIYM.exp_hist_expedientes.idtipo_escrito = 1
                  OR SIYM.exp_hist_expedientes.idtipo_escrito = 2);

                EXCEPTION
                  WHEN NO_DATA_FOUND THEN
                    dbms_output.put_line ('No Existe un expediente para el operador nro:'||reg.idoperador);
                  WHEN TOO_MANY_ROWS THEN
                    dbms_output.put_line ('Existe mas de un expediente para el operador nro:'||reg.idoperador);
              END;
            WHEN TOO_MANY_ROWS THEN
              dbms_output.put_line ('Existe mas de un expediente para el operador nro:'||reg.idoperador);
        END;

        INSERT INTO SIYM.exp_hist_expedientes
        (idexpediente, fecha, idtipo_escrito, escrito)
        VALUES (v_nro_exp, SYSDATE, 6, SIYM.exp_nota_bajas_seq.CURRVAL  || '/' || TO_CHAR(SYSDATE, 'YYYY'));
      END LOOP;
    END IF;
END;

CREATE OR REPLACE PROCEDURE prd_cargar_ord_despachos_items (p_orden NUMBER) AS CURSOR c_ordenes IS SELECT it.caja, it.idcodigo, it.cantidad, it.accion, emit.* FROM siym.tmp_ord_items_procedure it INNER JOIN siym.ord_emitidas emit ON it.orden = emit.orden WHERE it.orden = p_orden ORDER BY it.caja;
cant_packs NUMBER; formatocod NVARCHAR2 (3); formato_023 NVARCHAR2 (3); formato_153 NVARCHAR2 (3); pack_023 NUMBER; pack_153 NUMBER; ejecuto BOOLEAN; id_despacho NUMBER; BEGIN /***************************************** SE BUSCA LA CANTIDAD DE PACKS POR FORMATO ***********************************************/ pack_023 := 12; pack_153 := 4; formato_023 := '023'; formato_153 := '153'; ejecuto := FALSE; /******************* CARGA LA TABLA TEMPORAL *******************/ siym.prd_cargar_ord_items_procedure (p_orden);
DELETE FROM siym.ord_despachos_items WHERE iddespacho IN (SELECT iddespacho FROM siym.ord_despachos WHERE orden = p_orden);
/*DELETE FROM siym.ord_despachos WHERE orden = p_orden;*/ COMMIT;
FOR formato IN (SELECT SUBSTR (idcodigo, 2) codigo FROM siym.ord_items WHERE orden = p_orden GROUP BY SUBSTR (idcodigo, 2)) LOOP BEGIN SELECT pack_x_caja, SUBSTR (idcodigo, 2) INTO cant_packs, formatocod FROM siym.est_codigos WHERE SUBSTR (idcodigo, 2) = formato.codigo GROUP BY SUBSTR (idcodigo, 2), pack_x_caja;
CASE WHEN formato.codigo = '023' THEN pack_023 := cant_packs; formato_023 := formatocod; WHEN formato.codigo = '153' THEN pack_153 := cant_packs; formato_153 := formatocod; END CASE; END; END LOOP;
/***************************************** SE BUSCA LOS PACKINGS ***********************************************/ -- CABECERA DE DESPACHOS BEGIN SELECT NVL ((SELECT iddespacho FROM siym.ord_despachos WHERE orden = p_orden), 0) INTO id_despacho FROM DUAL;
IF (id_despacho = 0) THEN INSERT INTO siym.ord_despachos (iddespacho, fecha, orden ) VALUES (siym.ord_despachos_seq.NEXTVAL, SYSDATE, p_orden );
SELECT siym.ord_despachos_seq.CURRVAL INTO id_despacho FROM DUAL; END IF; EXCEPTION WHEN OTHERS THEN ejecuto := FALSE; DBMS_OUTPUT.put_line ('NO SE INSERTO EN SIYM.ORD_DESPACHOS'); END;
FOR orden IN c_ordenes LOOP BEGIN DBMS_OUTPUT.put_line ( 'CODIGO:' || orden.idcodigo || ' ** BULTO:' || orden.caja || ' ** CANT:' || orden.cantidad ); cant_packs := 0;
IF (TRIM (orden.accion) = 'CAJA_CERRADA') THEN BEGIN DBMS_OUTPUT.put_line ('ES CAJA CERRADA');
FOR packings IN (SELECT p.caja, p.pack, p.idserie, p.identrega FROM siym.est_packing p WHERE (p.idcodigo, p.caja, p.pack, p.idserie) NOT IN ( SELECT di.idcodigo, di.caja, di.pack, di.idserie FROM siym.ord_despachos_items di) AND (p.idsucursal, p.idbanco, p.idcodigo, p.caja, p.pack, p.idserie, p.identrega ) NOT IN ( SELECT pb.idsucursal, pb.idbanco, pb.idcodigo, pb.caja, pb.pack, pb.idserie, pb.identrega FROM siym.est_packing_bajas pb) AND (p.idcodigo, p.caja, p.idserie, p.identrega) IN ( SELECT ed.idcodigo, ed.caja, ed.idserie, ed.identrega FROM siym.est_entregas_detalles ed WHERE ed.idestado = 2) AND p.orden IS NULL AND p.fecha_bco IS NULL AND (p.caja, p.idserie, p.identrega) IN ( SELECT p.caja, p.idserie, p.identrega FROM siym.est_packing p WHERE (p.idcodigo, p.caja, p.pack, p.idserie ) NOT IN ( SELECT di.idcodigo, di.caja, di.pack, di.idserie FROM siym.ord_despachos_items di) AND (p.idsucursal, p.idbanco, p.idcodigo, p.caja, p.pack, p.idserie, p.identrega ) NOT IN ( SELECT pb.idsucursal, pb.idbanco, pb.idcodigo, pb.caja, pb.pack, pb.idserie, pb.identrega FROM siym.est_packing_bajas pb) AND p.orden IS NULL AND p.fecha_bco IS NULL AND p.idsucursal = orden.idsucursal AND p.idbanco = orden.idbanco AND p.idcodigo = orden.idcodigo GROUP BY p.caja, p.idserie, p.identrega HAVING COUNT (DISTINCT p.pack) = CASE WHEN SUBSTR (orden.idcodigo, 2) = formato_023 THEN pack_023 ELSE pack_153 END) GROUP BY p.caja, p.pack, p.idserie, p.identrega ORDER BY p.idserie, p.caja, p.pack) LOOP BEGIN cant_packs := cant_packs + 1; DBMS_OUTPUT.put_line ( 'CAJA:' || packings.caja || ' ** SERIE:' || packings.idserie || ' ** PACK:' || packings.pack || ' ** ENTREGA:' || packings.identrega );
-- DETALLE DE DESPACHOS INSERT INTO siym.ord_despachos_items VALUES (id_despacho, orden.idcodigo, packings.caja, packings.pack, packings.idserie, orden.caja);
IF (cant_packs = orden.cantidad) THEN ejecuto := TRUE; ELSE ejecuto := FALSE; END IF;
EXIT WHEN cant_packs = orden.cantidad; END; END LOOP; END; ELSE BEGIN DBMS_OUTPUT.put_line ('CAJA ABIERTA');
FOR packings IN (SELECT * FROM (SELECT p.caja, p.pack, p.idserie, p.identrega, 1 orden FROM siym.est_packing p WHERE (p.idbanco = 3 AND p.idsucursal = 11) AND (p.idcodigo, p.caja, p.pack, p.idserie ) NOT IN ( SELECT di.idcodigo, di.caja, di.pack, di.idserie FROM siym.ord_despachos_items di) AND (p.idsucursal, p.idbanco, p.idcodigo, p.caja, p.pack, p.idserie, p.identrega ) NOT IN ( SELECT pb.idsucursal, pb.idbanco, pb.idcodigo, pb.caja, pb.pack, pb.idserie, pb.identrega FROM siym.est_packing_bajas pb) AND (p.idcodigo, p.caja, p.idserie, p.identrega ) IN ( SELECT ed.idcodigo, ed.caja, ed.idserie, ed.identrega FROM siym.est_entregas_detalles ed WHERE ed.idestado = 2) AND p.orden IS NULL AND p.fecha_bco IS NULL AND (p.caja, p.idserie, p.identrega, p.idcodigo) IN ( SELECT p.caja, p.idserie, p.identrega, p.idcodigo FROM siym.est_packing p WHERE (p.idcodigo, p.caja, p.pack, p.idserie ) NOT IN ( SELECT di.idcodigo, di.caja, di.pack, di.idserie FROM siym.ord_despachos_items di) AND (p.idsucursal, p.idbanco, p.idcodigo, p.caja, p.pack, p.idserie, p.identrega ) NOT IN ( SELECT pb.idsucursal, pb.idbanco, pb.idcodigo, pb.caja, pb.pack, pb.idserie, pb.identrega FROM siym.est_packing_bajas pb) AND p.orden IS NULL AND p.fecha_bco IS NULL AND p.idsucursal = 11 AND p.idbanco = 3 AND p.idcodigo = orden.idcodigo GROUP BY p.caja, p.idserie, p.identrega, p.idcodigo HAVING COUNT (DISTINCT p.pack) < CASE WHEN SUBSTR (orden.idcodigo, 2 ) = '023' THEN 12 ELSE 4 END) GROUP BY p.caja, p.pack, p.idserie, p.identrega --ORDER BY p.identrega, p.pack UNION SELECT p.caja, p.pack, p.idserie, p.identrega, 2 orden FROM siym.est_packing p WHERE (p.idbanco = 3 AND p.idsucursal = 11) AND (p.idcodigo, p.caja, p.pack, p.idserie ) NOT IN ( SELECT di.idcodigo, di.caja, di.pack, di.idserie FROM siym.ord_despachos_items di) AND (p.idsucursal, p.idbanco, p.idcodigo, p.caja, p.pack, p.idserie, p.identrega ) NOT IN ( SELECT pb.idsucursal, pb.idbanco, pb.idcodigo, pb.caja, pb.pack, pb.idserie, pb.identrega FROM siym.est_packing_bajas pb) AND (p.idcodigo, p.caja, p.idserie, p.identrega ) IN ( SELECT ed.idcodigo, ed.caja, ed.idserie, ed.identrega FROM siym.est_entregas_detalles ed WHERE ed.idestado = 2) AND p.orden IS NULL AND p.fecha_bco IS NULL AND (p.caja, p.idserie, p.identrega, p.idcodigo) IN ( SELECT p.caja, p.idserie, p.identrega, p.idcodigo FROM siym.est_packing p WHERE (p.idcodigo, p.caja, p.pack, p.idserie ) NOT IN ( SELECT di.idcodigo, di.caja, di.pack, di.idserie FROM siym.ord_despachos_items di) AND (p.idsucursal, p.idbanco, p.idcodigo, p.caja, p.pack, p.idserie, p.identrega ) NOT IN ( SELECT pb.idsucursal, pb.idbanco, pb.idcodigo, pb.caja, pb.pack, pb.idserie, pb.identrega FROM siym.est_packing_bajas pb) AND p.orden IS NULL AND p.fecha_bco IS NULL AND p.idsucursal = 11 AND p.idbanco = 3 AND p.idcodigo = orden.idcodigo GROUP BY p.caja, p.idserie, p.identrega, p.idcodigo HAVING COUNT (DISTINCT p.pack) = CASE WHEN SUBSTR (orden.idcodigo, 2 ) = '023' THEN 12 ELSE 4 END) GROUP BY p.caja, p.pack, p.idserie, p.identrega) a ORDER BY orden, idserie, caja, pack) LOOP BEGIN cant_packs := cant_packs + 1; DBMS_OUTPUT.put_line ( 'CAJA:' || packings.caja || ' ** SERIE:' || packings.idserie || ' ** PACK:' || packings.pack || ' ** ENTREGA:' || packings.identrega );
-- DETALLE DE DESPACHOS INSERT INTO siym.ord_despachos_items VALUES (id_despacho, orden.idcodigo, packings.caja, packings.pack, packings.idserie, orden.caja);
IF (cant_packs = orden.cantidad) THEN ejecuto := TRUE; ELSE ejecuto := FALSE; END IF;
EXIT WHEN cant_packs = orden.cantidad; END; END LOOP; END; END IF; EXCEPTION WHEN OTHERS THEN ejecuto := FALSE; DBMS_OUTPUT.put_line ('NO SE INSERTO EN SIYM.ORD_DESPACHOS_ITEMS'); END; END LOOP;
IF (ejecuto) THEN FOR orden IN (SELECT * FROM siym.ord_items WHERE orden = p_orden ORDER BY orden) LOOP BEGIN -- cant_packs SELECT COUNT (*) INTO cant_packs FROM siym.ord_despachos_items WHERE iddespacho = id_despacho AND idcodigo = orden.idcodigo;
IF (orden.cantidad <> cant_packs) THEN ejecuto := FALSE; ROLLBACK; DBMS_OUTPUT.put_line ('********************* ERROR EN EJECUCION PRD_CARGAR_ORD_DESPACHOS_ITEMS **********************' ); DBMS_OUTPUT.put_line ( '********************* DIFERENCIA DE CANTIDADES EN FORMATO_CODIGO ' || orden.idcodigo || ' **********************' ); END IF;
EXIT WHEN cant_packs <> orden.cantidad; END; END LOOP;
IF (ejecuto) THEN COMMIT; DBMS_OUTPUT.put_line ('********************* FIN DE PROCESO PRD_CARGAR_ORD_DESPACHOS_ITEMS **********************' ); END IF; ELSE ROLLBACK; DBMS_OUTPUT.put_line ('********************* ERROR EN EJECUCION PRD_CARGAR_ORD_DESPACHOS_ITEMS **********************' ); END IF; END;

CREATE OR REPLACE PROCEDURE      prd_cargar_ord_items_procedure (p_orden NUMBER)
AS
   CURSOR c_ordenes
   IS
      SELECT   it.iditem, it.idcodigo, it.cantidad, emit.*
          FROM siym.ord_items it INNER JOIN siym.ord_emitidas emit
               ON it.orden = emit.orden
         WHERE it.orden = p_orden
      ORDER BY it.idcodigo;

   cant_total_packs      NUMBER;
   cant_cajas_cerradas   NUMBER;
   cant_packs_x_cod      NUMBER;
   resto_packs           NUMBER;
   cant_packings         NUMBER;
   nro_caja              NUMBER;
   diferencia            NUMBER;
   dife_153              NUMBER;
   dife_023              NUMBER;
   cant_023              NUMBER;
   cant_153              NUMBER;
   resto_023             NUMBER;
   resto_153             NUMBER;
   pack_023              NUMBER;
   pack_153              NUMBER;
BEGIN
   nro_caja := 0;
   resto_023 := 0;
   resto_153 := 0;
   pack_023 := 0;
   pack_153 := 0;
   cant_total_packs := 0;
   cant_cajas_cerradas := 0;
   cant_packs_x_cod := 0;

   DELETE FROM siym.tmp_ord_items_procedure
         WHERE orden = p_orden;

   COMMIT;

   /*****************************************  OBTIENE LAS CAJAS CERRADAS ***********************************************/
   FOR orden IN c_ordenes
   LOOP
      BEGIN
         SELECT pack_x_caja
           INTO cant_packs_x_cod
           FROM siym.est_codigos
          WHERE idcodigo = orden.idcodigo;

         IF (orden.cantidad >= cant_packs_x_cod)
         THEN
            resto_packs := 0;

            SELECT FLOOR (orden.cantidad / cant_packs_x_cod)
              INTO cant_cajas_cerradas
              FROM DUAL;

            IF (cant_cajas_cerradas > 0)
            THEN
               SELECT MOD (orden.cantidad, cant_packs_x_cod)
                 INTO resto_packs
                 FROM DUAL;

               FOR lcntr IN 1 .. cant_cajas_cerradas
               LOOP
                  BEGIN
                     nro_caja := nro_caja + 1;

                     INSERT INTO siym.tmp_ord_items_procedure
                          VALUES (p_orden, orden.idcodigo, cant_packs_x_cod,
                                  'CAJA_CERRADA', nro_caja);
                  END;
               END LOOP;

               IF (resto_packs > 0)
               THEN
                  INSERT INTO siym.tmp_ord_items_procedure
                       VALUES (p_orden, orden.idcodigo, resto_packs, 'RESTO',
                               0);
               END IF;
            END IF;
         ELSE
            INSERT INTO siym.tmp_ord_items_procedure
                 VALUES (p_orden, orden.idcodigo, orden.cantidad, 'RESTO', 0);
         END IF;
      END;
   END LOOP;

/****************************************  PRIMER VERIFICACION DE ARMADO DE CAJAS DEL MISMO FORMATO **********************************************/
   FOR formato IN (SELECT   SUBSTR (idcodigo, 2) codigo
                       FROM siym.ord_items
                      WHERE orden = p_orden
                   GROUP BY SUBSTR (idcodigo, 2))
   LOOP
      BEGIN
         SELECT   pack_x_caja
             INTO cant_packs_x_cod
             FROM siym.est_codigos
            WHERE SUBSTR (idcodigo, 2) = formato.codigo
         GROUP BY SUBSTR (idcodigo, 2), pack_x_caja;

         SELECT SUM (cantidad)
           INTO cant_packings
           FROM siym.tmp_ord_items_procedure
          WHERE orden = p_orden
            AND accion = 'RESTO'
            AND SUBSTR (idcodigo, 2) = formato.codigo;

         CASE
            WHEN formato.codigo = '023'
            THEN
               resto_023 := cant_packings;
               pack_023 := cant_packs_x_cod;
            WHEN formato.codigo = '153'
            THEN
               resto_153 := cant_packings;
               pack_153 := cant_packs_x_cod;
         END CASE;


         IF (cant_packings >= cant_packs_x_cod)
         THEN
            nro_caja :=
               siym.fn_buscar_cajas_cerradas (p_orden,
                                              formato.codigo,
                                              nro_caja,
                                              cant_packs_x_cod
                                             );
         END IF;
      END;
   END LOOP;

/****************************************  ARMADO DE CAJAS DEL RESTO **********************************************/
   nro_caja := siym.fn_buscar_restos (p_orden, nro_caja);
   COMMIT;
   DBMS_OUTPUT.put_line
      ('********************* FIN DE PROCESO PRD_CARGAR_ORD_ITEMS_PROCEDURE **********************'
      );
END;

CREATE OR REPLACE PROCEDURE PRD_CCG_AJUSTE_LIQUIDACION ( p_periodo DATE, p_idoperador NUMBER ) AS BEGIN
DECLARE id_liq VARCHAR(10);
CURSOR v_obj_liq IS select idoperador, dif from ccg$_liq_diferencias where idoperador = p_idoperador and periodo = p_periodo and dif <> 0;
BEGIN FOR fila IN v_obj_liq LOOP
SELECT DISTINCT ccg_liquidaciones.idliquidacion INTO id_liq FROM ccg_liquidaciones WHERE idoperador=fila.idoperador and periodo=p_periodo ;
if fila.dif < 0 then insert into ccg_detalle_liquidaciones values ( ccg_detalle_liquidaciones_seq.nextval, id_liq, sysdate, 2, fila.dif, null );
else insert into ccg_detalle_liquidaciones values ( ccg_detalle_liquidaciones_seq.nextval, id_liq, sysdate, 3, fila.dif, null ); end if; end loop; END ; END PRD_CCG_AJUSTE_LIQUIDACION;

CREATE OR REPLACE PROCEDURE prd_ccg_alta_renaf AS v_lote_n NUMBER; BEGIN SELECT MAX(siym.ccg_f1226_cabecera.lote_n) INTO v_lote_n FROM siym.ccg_f1226_cabecera; DBMS_OUTPUT.PUT_LINE( 'Lote '||v_lote_n ); INSERT INTO ccg_renaf ( idempresa, nombre, fecha_alta, fecha_baja, activo ) ( SELECT DISTINCT renaf_habil.idempresa, renaf_habil.nombre, tmp_ccg_renaf.fecha_alta, NULL, 0 FROM ( SELECT DISTINCT reg$_operadores2.idempresa, reg$_operadores2.nombre FROM siym.reg$_operadores2 WHERE reg$_operadores2.idempresa NOT IN ( SELECT DISTINCT no_renaf.idempresa FROM siym.reg$_operadores2 no_renaf WHERE no_renaf.idtipo_operador IN ( 4, 5 ) AND no_renaf.alta IS NOT NULL AND no_renaf.baja IS NULL ) AND reg$_operadores2.idtipo_operador = 1 AND reg$_operadores2.alta IS NOT NULL AND reg$_operadores2.baja IS NULL ) renaf_habil INNER JOIN siym.tmp_ccg_renaf ON renaf_habil.idempresa = tmp_ccg_renaf.idempresa WHERE renaf_habil.idempresa NOT IN ( SELECT siym.ccg_renaf.idempresa FROM ccg_renaf ) );
/*BAJA POR INGRESO A RENAF*/
INSERT INTO siym.ccg_convenio_bajas ( idempresa, alta, baja, lote_n ) ( SELECT ccg_convenio.idempresa, ccg_convenio.alta, to_char(sysdate, 'DD/MM/RRRR'), v_lote_n FROM siym.ccg_convenio INNER JOIN siym.ccg_renaf ON ccg_convenio.idempresa = ccg_renaf.idempresa WHERE ccg_renaf.activo = 0);
DELETE FROM siym.ccg_convenio WHERE idempresa IN ( SELECT ccg_convenio_bajas.idempresa FROM ccg_convenio INNER JOIN ccg_convenio_bajas ON ccg_convenio_bajas.idempresa = ccg_convenio.idempresa WHERE ccg_convenio_bajas.lote_n = v_lote_n );
COMMIT; END prd_ccg_alta_renaf;

CREATE OR REPLACE PROCEDURE PRD_CCG_CREDITO_RENAF 
(
  P_IDOPERADO IN NUMBER, 
  P_PERIODO IN DATE, 
  P_KILOS IN NUMBER 
) AS 

V_ESTADO NUMBER;

BEGIN

  SELECT COUNT(CCG_CREDITOS.IDOPERADOR) INTO V_ESTADO FROM CCG_CREDITOS WHERE CCG_CREDITOS.IDOPERADOR = P_IDOPERADO AND CCG_CREDITOS.PERIODO = P_PERIODO AND CCG_CREDITOS.IDTIPO_CREDITO = 7;
