    dbms_output.put_line('CREDITO OTORGADO');
  ELSE 
    dbms_output.put_line('CREDITO NO OTORGADO');
  END IF;
END PRD_CCG_CREDITO_RENAF;

CREATE OR REPLACE PROCEDURE prd_ccg_cupo_ymc_me ( p_idoperador IN NUMBER, p_periodo IN VARCHAR2 ) AS v_estado NUMBER; BEGIN /* * Se genera cupo de credito por ingreso de YMC desde Mercado Externo * para los importadores */ SELECT COUNT(reg$_operadores2.idoperador) INTO v_estado FROM siym.reg$_operadores2 WHERE reg$_operadores2.idtipo_operador = 6 AND reg$_operadores2.idoperador = p_idoperador;
IF v_estado <> 0 THEN UPDATE siym.ddjj_ingresos SET idorigen = 2 WHERE ddjj_ingresos.idoperador = p_idoperador AND ddjj_ingresos.periodo = to_date(p_periodo, 'RRRR-MM-DD') AND ddjj_ingresos.idestado_yerba = 2;
SELECT COUNT(ccg_creditos.idoperador) INTO v_estado FROM siym.ccg_creditos WHERE ccg_creditos.idoperador = p_idoperador AND ccg_creditos.periodo = to_date(p_periodo, 'RRRR-MM-DD') AND ccg_creditos.idtipo_credito = 5;
IF v_estado = 0 THEN INSERT INTO ccg_creditos ( idcredito, idoperador, periodo, fecha, idtipo_credito, kilos ) SELECT ccg_creditos_seq.NEXTVAL idcredito, a.idoperador, a.periodo, a.fecha, a.tipo_credito, a.kilos FROM ( SELECT idoperador, periodo, to_date(sysdate, 'DD/MM/RRRR') fecha, 5 tipo_credito, SUM(kilos) kilos FROM siym.ddjj$_total_ing_ym WHERE periodo = to_date(p_periodo, 'RRRR-MM-DD') AND idestado_yerba = 2 AND idoperador = p_idoperador AND idorigen = 2 GROUP BY idoperador, periodo, to_date(sysdate, 'DD/MM/RRRR') , 5 ) a;
dbms_output.put_line('CREDITO OTORGADO'); ELSE UPDATE ccg_creditos SET kilos = ( SELECT SUM(kilos) kilos FROM siym.ddjj$_total_ing_ym WHERE periodo = to_date(p_periodo, 'RRRR-MM-DD') AND idoperador = p_idoperador AND idestado_yerba = 2 AND idorigen = 2 ), fecha = to_date(sysdate, 'DD/MM/RRRR') WHERE periodo = to_date(p_periodo, 'RRRR-MM-DD') AND idoperador = p_idoperador AND idtipo_credito = 5;
dbms_output.put_line('EL CREDITO FUE ACTUALIZADO, RECTIFICATIVA');
END IF;
ELSE dbms_output.put_line('CREDITO NO OTORGADO, NO ES IMPORTADOR'); END IF;
END prd_ccg_cupo_ymc_me;

CREATE OR REPLACE PROCEDURE PRD_CCG_ELIMINA_COMPROBANTES( P_IDOPERADOR IN SIYM.ccg_cert_retencion.idoperador%type, P_IDCERTIFICADO IN SIYM.ccg_cert_retencion.idcertificado%type, P_RETORNO OUT VARCHAR )
AS V_IDCER_NO_APLICACION SIYM.ccg_cert_retencion.idcert_no_aplicacion%type; V_FECHA SIYM.ccg_cert_retencion.fecha_eliminacion%TYPE; V_FECHA_ELIMINACION SIYM.ccg_cert_retencion.fecha_eliminacion%TYPE;
BEGIN BEGIN V_FECHA:= SYSDATE; SELECT FECHA_ELIMINACION INTO V_FECHA_ELIMINACION FROM SIYM.CCG_CERT_RETENCION WHERE CCG_CERT_RETENCION.IDCERTIFICADO = P_IDCERTIFICADO AND CCG_CERT_RETENCION.IDOPERADOR = P_IDOPERADOR;
SELECT CCG_CERT_RETENCION.IDCERT_NO_APLICACION INTO V_IDCER_NO_APLICACION FROM SIYM.CCG_CERT_RETENCION WHERE CCG_CERT_RETENCION.IDCERTIFICADO = P_IDCERTIFICADO AND CCG_CERT_RETENCION.IDOPERADOR = P_IDOPERADOR;
EXCEPTION WHEN NO_DATA_FOUND THEN V_IDCER_NO_APLICACION := NULL; END; IF V_FECHA_ELIMINACION IS NULL THEN
IF V_IDCER_NO_APLICACION IS NOT NULL THEN
UPDATE SIYM.CCG_CERT_RETENCION SET FECHA_ELIMINACION = V_FECHA WHERE IDCERTIFICADO = P_IDCERTIFICADO AND IDOPERADOR = P_IDOPERADOR;
UPDATE SIYM.CCG_CERT_NO_APLICACION SET FECHA_ELIMINACION=V_FECHA WHERE IDCERT_NO_APLICACION = V_IDCER_NO_APLICACION; P_RETORNO:='Certificado Eliminado Correctamente. N de Certificado: ' || P_IDCERTIFICADO; ELSE
UPDATE SIYM.CCG_CERT_RETENCION SET FECHA_ELIMINACION = V_FECHA WHERE IDCERTIFICADO = P_IDCERTIFICADO AND IDOPERADOR = P_IDOPERADOR; P_RETORNO:='Certificado Eliminado Correctamente. N de Certificado: '|| P_IDCERTIFICADO; END IF;
ELSE P_RETORNO:='ERROR: El Certificado de retencin ya se encuentra eliminado'; END IF;
END PRD_CCG_ELIMINA_COMPROBANTES;

CREATE OR REPLACE PROCEDURE PRD_CCG_LIQUIDACIONES ( p_periodo DATE, p_vencimiento DATE ) AS BEGIN
DECLARE nro_exp VARCHAR(10); nro_nota VARCHAR(11); nro_planilla VARCHAR(11); CURSOR v_obj_liq IS select idoperador, --ing, noret, cert, (ing-noret)-cert dif, ing, noret, (ing - noret) total, cert, (ing-noret)-cert dif, (select tarifa from ccg_tarifas_sustitutivas where idtipo_tarifa = 1 and fecha_inicio <= p_periodo and (fecha_fin >= p_periodo OR fecha_fin is null)) hv, (select tarifa from ccg_tarifas_sustitutivas where idtipo_tarifa = 4 and fecha_inicio <= p_periodo and (fecha_fin >= p_periodo OR fecha_fin is null)) hv_ymc from ( select idoperador, nvl((select to_number(to_char(sum(kilos) * max((select tarifa from ccg_tarifas_sustitutivas where idtipo_tarifa = 4 and fecha_inicio <= p_periodo and (fecha_fin >=i.periodo OR fecha_fin is null))),'999999999999.99'),'999999999999.99') as tarifa from ddjj$_total_ing_ym i where i.idestado_yerba=2 and i.periodo = p_periodo --and i.idtipo_operador in (7,9,10) and i.idoperador=r.idoperador and i.inymn not in (select idoperador from SIYM.reg_operadores where idtipo_operador in (7,9,10)) group by idoperador),0) ing, nvl((select sum(to_number(total, '9999999999999.99')) from ccg$_cert_noaplicacion inner join ccg_cert_retencion on ccg_cert_retencion.idcert_no_aplicacion = ccg$_cert_noaplicacion.idcert_no_aplicacion and ccg_cert_retencion.idoperador= ccg$_cert_noaplicacion.id_oper_valida where ccg$_cert_noaplicacion.id_oper_valida is not null and ccg$_cert_noaplicacion.fecha_eliminacion is null and ccg$_cert_noaplicacion.id_oper_valida = r.idoperador and ccg_cert_retencion.periodo= p_periodo and ccg_cert_retencion.fecha_eliminacion is null group by id_oper_valida),0) noret, nvl((select sum(importe) total from ccg_cert_retencion where fecha_eliminacion is null and idoperador = r.idoperador and periodo = p_periodo group by idoperador),0) cert from reg_operadores r where idtipo_operador in (7,9,10) and fn_verif_periodo(r.idoperador, to_char(p_periodo,'yyyy-mm-dd'))=1 and (r.idoperador, p_periodo) in (select idoperador, periodo from ddjj_declaraciones) --and (r.idoperador, p_periodo) in (select idoperador, periodo from ddjj_declaraciones where motivo=0) and (r.idoperador, p_periodo) not in (select idoperador, periodo from ccg_liquidaciones) --and r.idoperador = 20970 ); BEGIN FOR fila IN v_obj_liq LOOP INSERT INTO ccg_liquidaciones VALUES ( ccg_liquidaciones_seq.nextval, fila.idoperador, p_periodo, sysdate, fila.hv, fila.hv_ymc, p_vencimiento );
INSERT INTO ccg_hist_liquidaciones VALUES ( ccg_hist_liquidaciones_seq.nextval, sysdate, ccg_liquidaciones_seq.currval, 1, null, 92
);
if fila.total >=0 then insert into ccg_detalle_liquidaciones values ( ccg_detalle_liquidaciones_seq.nextval, ccg_liquidaciones_seq.currval, sysdate, 1, fila.ing, null ); if fila.noret > 0 then insert into ccg_detalle_liquidaciones values ( ccg_detalle_liquidaciones_seq.nextval, ccg_liquidaciones_seq.currval, sysdate, 2, -(fila.noret), null ); end if; else insert into ccg_detalle_liquidaciones values ( ccg_detalle_liquidaciones_seq.nextval, ccg_liquidaciones_seq.currval, sysdate, 4, --fila.cert 0, null ); end if; end loop; END ;
END PRD_CCG_LIQUIDACIONES;

CREATE OR REPLACE PROCEDURE PRD_CCG_PAGOS(
    p_fecha_pago DATE,
    p_boletanro INTEGER,
    p_importe FLOAT,
    p_idforma_pago INTEGER,
    p_retorno OUT VARCHAR)
AS
  interes FLOAT;
  total FLOAT;
  pendientes INTEGER;
  CURSOR v_obj_liq
  IS
  --select l.* from ccg$_liquidaciones l  where idestado=3 and nroboleta=p_boletanro;
  select l2.IDLIQUIDACION, l2.IDOPERADOR, l2.TOTAL, l2.IDBOLETA, l2.NROBOLETA, l2.VENC, l2.VENCIMIENTO, (select sum(d.IMPORTE) FROM ccg_liquidaciones l
    inner join CCG_DETALLE_LIQUIDACIONES d on l.IDLIQUIDACION = d.IDLIQUIDACION
    left join CCG_HIST_LIQUIDACIONES h on h.IDLIQUIDACION = d.IDLIQUIDACION and h.IDESTADO=4
    left join INYM_DETALLE_BOLETAS b on h.IDBOLETA = b.IDBOLETA
    where l.IDLIQUIDACION = l2.IDLIQUIDACION and (d.FECHA > h.FECHA OR h.FECHA is null)
    group by idoperador, periodo
    ) IMPORTE from ccg$_liquidaciones l2  where idestado=3 and nroboleta = p_boletanro;
BEGIN
  FOR fila IN v_obj_liq LOOP
    --total:=fila.TOTAL - nvl(fila.IMPORTE_PAGADO,0);
    total:=fila.IMPORTE;
    interes:=total * ((p_fecha_pago-fila.venc)*(0.197/100));

    IF interes<0 THEN
      interes:=0;
    END IF;
    --Chequeamos si el importe pagado es correcto, o sea si el total liquidado mas interes, si hubiera, es igual
    --Si no es igual no se carga el papo y mostramos un error
    IF round((total+interes),2)=p_importe THEN
      --Si la boleta esta vencida verificamos que la fecha de pago sea igual al vencimiento de la boleta
      --sino, actualizamos la boleta con el vencimiento y monto que corresponden al pago
      IF interes>0 THEN
        update inym_detalle_boletas set fecha_vencimiento=p_fecha_pago, importe = total + interes
        where idboleta=fila.idboleta;
      END IF;

      IF p_fecha_pago <= fila.VENC THEN
        update inym_detalle_boletas set fecha_vencimiento=fila.VENC, importe = fila.IMPORTE
        where idboleta=fila.idboleta;
      END IF;
      --IF p_fecha_pago >= fila.VENC AND p_fecha_pago <> fila.VENCIMIENTO THEN
      --  update inym_detalle_boletas set fecha_vencimiento=p_fecha_pago, importe = total + interes
      --  where idboleta=fila.idboleta;
      --END IF;

      dbms_output.put_line('Boleta actualizada');

      --Cargamos la forma y fecha de pago en la boleta
      update inym_detalle_boletas set idforma_pago=p_idforma_pago, fecha_pago=p_fecha_pago,
                                      idusuario_carga_pago = sys_context('USERENV','SESSION_USERID'),
                                      fecha_carga_pago = sysdate
      where idboleta=fila.idboleta;

      --Actualizamos el estado de la liquidacion a PAGADO
      INSERT INTO CCG_HIST_LIQUIDACIONES values (CCG_HIST_LIQUIDACIONES_SEQ.NEXTVAL, SYSDATE, fila.IDLIQUIDACION, 4, fila.IDBOLETA, sys_context('USERENV','SESSION_USERID'));

      select count(l.periodo) into pendientes from CCG$_LIQUIDACIONES l where IDOPERADOR = fila.IDOPERADOR and IDESTADO =3
      and add_months(trunc(l.venc,'month'),1) < sysdate;

      --Si es boleta vencida, habilitamos al operador
      IF pendientes = 0 THEN
        PRD_INHABILITACIONES(10, fila.IDOPERADOR, null, null, sys_context('USERENV','SESSION_USERID'), 'U');
      END IF;
      p_retorno:='Pago Cargado.';
    ELSE
      dbms_output.put_line('ERROR: el importe pagado es incorrecto.' || ' ' || round((total+interes),2) || ' ' || total || ' ' || interes || ' ' || p_importe);
      p_retorno:='ERROR: el importe pagado es incorrecto.' || ' ' || total || ' ' || interes || ' ' || p_importe;
    END IF;

  END LOOP;
END;

