(
  p_idoperador SIYM.ccg_cert_retencion.idoperador%TYPE,
  p_periodo SIYM.ccg_cert_retencion.periodo%TYPE,
  p_oper_retenido SIYM.ccg_cert_retencion.oper_retenido%TYPE,
