  p_nro_cert OUT number
) AS   
  nro_cert      number;
  tarifa float;
  importe_no_retenido float;
  tasa_sindical float;
  importe float;
  idtipo_tarifa number;
  cert_no_aplicacion number;
  origen number;
  tipo_oper number;
BEGIN
  --Obtengo el numero de certificado, correlativo por operador
  select nvl(max(idcertificado)+1,1) into nro_cert 
  from siym.ccg_cert_retencion
  where idoperador=p_idoperador;

  --Obtengo el valor de la tarifa, de acuerdo al tipo indicado
  select tarifa, idtipo_tarifa into tarifa, idtipo_tarifa
  from siym.ccg_tarifas_sustitutivas
  where idtipo_tarifa=decode(p_tipo_tarifa, 'hv',1,'ymc',3,'hv_ymc',4)
  and fecha_inicio <=to_date(p_periodo,'DD/MM/YYYY') and (fecha_fin >= to_date(p_periodo,'DD/MM/YYYY') or fecha_fin is null);

  --Obtengo el importe que no debe retenerse, 
  --buscando el certificado de no aplicacion, si corresponde
  select  nvl(sum(kilos * tarifa),0) into importe_no_retenido from SIYM.ccg_detalle_cert_no_aplic d
  join SIYM.ccg_cert_no_aplicacion c on d.idcert_no_aplicacion = c.idcert_no_aplicacion
  join SIYM.ccg_tarifas_sustitutivas on SIYM.ccg_tarifas_sustitutivas.idtipo_tarifa = decode(idtipo_credito, 1,4,2,2,3,4,4,2,5,4,6,4,7,1) 
  and fecha_inicio <=to_date(c.periodo,'DD/MM/YYYY') and (fecha_fin >= to_date(c.periodo,'DD/MM/YYYY') or fecha_fin is null)
  where c.idcert_no_aplicacion=p_idcert_no_aplicacion;

  IF (round(importe_no_retenido,2) > round((p_kilos*tarifa),2) ) THEN
    importe_no_retenido:=0;
  END IF;

  --Obtengo la tasa sindical
  BEGIN  
    select tarifa into tasa_sindical
    from siym.ccg_tarifas_sustitutivas
    where idtipo_tarifa=5
    and fecha_inicio <=to_date(p_periodo,'DD/MM/YYYY') and (fecha_fin >= to_date(p_periodo,'DD/MM/YYYY') or fecha_fin is null);
  EXCEPTION
     WHEN NO_DATA_FOUND THEN
       tasa_sindical := 0;
  END;
  --Calculo el importe de la tasa sindical
  tasa_sindical:=(round((p_kilos*tarifa),2)-nvl(importe_no_retenido,0))*tasa_sindical;

  select idtipo_operador into tipo_oper from reg_operadores where idoperador = p_oper_retenido;

  --Calculo el TOTAL de la retencin
  --Si el operador retenido es tipo 6 (IMPORTADOR) y TIPO TARIFA = 4 (HV + YMC)
  --IF (tipo_oper=6 AND idtipo_tarifa = 4) THEN
  --  importe := 0;
  --ELSE
    importe := ((p_kilos*tarifa)-nvl(importe_no_retenido,0))+tasa_sindical;
  --END IF;  

  IF (p_idcert_no_aplicacion=0) THEN
    cert_no_aplicacion:=null;
  ELSE
    cert_no_aplicacion:=p_idcert_no_aplicacion;
  END IF;

  IF (p_oper_origen=0) THEN
    origen:=null;
  ELSE
    origen:=p_oper_origen;
  END IF;

  insert into SIYM.ccg_cert_retencion values (nro_cert, p_idoperador, sysdate, to_date(p_periodo,'DD/MM/YYYY'), tarifa, p_oper_retenido, p_kilos, importe, origen, cert_no_aplicacion, importe_no_retenido, null, tasa_sindical, idtipo_tarifa, p_stock_tercero);

  DBMS_OUTPUT.put_line(nro_cert);

  p_nro_cert:=nro_cert;

END;

CREATE OR REPLACE PROCEDURE PRD_CGG_HABILITAR_RETECIONES 
(
  P_IDOPERADOR IN NUMBER, 
  P_PERIODO IN DATE,
  P_EXCEPCION IN NUMBER, -- 0 CONTOLA HABILITAR CERTIFICADO DE NO RETENCION
                        -- 1 HABILITA SIN CONTROL CERTIFICADO DE NO RETENCION
  P_RETORNO OUT VARCHAR

) AS 
  V_TIPO   NUMBER;
  V_ESTADO NUMBER;
  V_ACTIVO NUMBER;
BEGIN

  SELECT COUNT(SIYM.CCG_PERIODOS.IDOPERADOR) INTO V_ACTIVO FROM SIYM.CCG_PERIODOS WHERE SIYM.CCG_PERIODOS.IDOPERADOR = P_IDOPERADOR AND CCG_PERIODOS.PERIODO = TO_DATE(P_PERIODO,'DD/MM/RRRR') AND SIYM.CCG_PERIODOS.VENCIMIENTO > SysDate;


  IF V_ACTIVO = 0 THEN

    IF P_EXCEPCION = 0 THEN


      SELECT IDTIPO_OPERADOR INTO V_TIPO FROM SIYM.REG_OPERADORES WHERE IDOPERADOR = P_IDOPERADOR;

      IF V_TIPO = 6 OR V_TIPO = 8 OR V_TIPO = 10  THEN

        SELECT CCG$_LIQUIDACIONES.IDESTADO INTO V_ESTADO FROM SIYM.CCG$_LIQUIDACIONES WHERE CCG$_LIQUIDACIONES.IDOPERADOR = P_IDOPERADOR AND CCG$_LIQUIDACIONES.PERIODO  = P_PERIODO ;

        IF V_ESTADO = 1 THEN
          INSERT INTO SIYM.CCG_PERIODOS ( IDPERIODO,IDOPERADOR,PERIODO,VENCIMIENTO, aplica_cert) VALUES ( SIYM.CCG_PERIODOS_SEQ.NEXTVAL , P_IDOPERADOR, TO_DATE(P_PERIODO,'DD/MM/RRRR'), TO_DATE(SYSDATE,'DD/MM/RRRR') + 5,1);
          P_RETORNO:='DEPOSITADOR HABILITA CERTIFICADO DE NO APLICACION';
        ELSE
          INSERT INTO SIYM.CCG_PERIODOS ( IDPERIODO,IDOPERADOR,PERIODO,VENCIMIENTO, aplica_cert) VALUES ( SIYM.CCG_PERIODOS_SEQ.NEXTVAL , P_IDOPERADOR, TO_DATE(P_PERIODO,'DD/MM/RRRR'), TO_DATE(SYSDATE,'DD/MM/RRRR') + 5,0);
          P_RETORNO:='DEPOSITADOR INHABILITA CERTIFICADO DE NO APLICACION';
        END IF;
      ELSE
        INSERT INTO SIYM.CCG_PERIODOS ( IDPERIODO,IDOPERADOR,PERIODO,VENCIMIENTO, aplica_cert) VALUES ( SIYM.CCG_PERIODOS_SEQ.NEXTVAL , P_IDOPERADOR, TO_DATE(P_PERIODO,'DD/MM/RRRR'), TO_DATE(SYSDATE,'DD/MM/RRRR') + 5,1);
        P_RETORNO:='HABILITA CERTIFICADO DE NO APLICACION';
      END IF;

    ELSE
        INSERT INTO SIYM.CCG_PERIODOS ( IDPERIODO,IDOPERADOR,PERIODO,VENCIMIENTO, aplica_cert) VALUES ( SIYM.CCG_PERIODOS_SEQ.NEXTVAL , P_IDOPERADOR, TO_DATE(P_PERIODO,'DD/MM/RRRR'), TO_DATE(SYSDATE,'DD/MM/RRRR') + 5,1);
        P_RETORNO:='HABILITA CERTIFICADO DE NO APLICACION';
    END IF;
  ELSE
     P_RETORNO:='EL PERIODO YA SE ENCUENTRA HABILITADO';
  END IF;

EXCEPTION
      WHEN NO_DATA_FOUND THEN
        INSERT INTO SIYM.CCG_PERIODOS ( IDPERIODO,IDOPERADOR,PERIODO,VENCIMIENTO, aplica_cert) VALUES ( SIYM.CCG_PERIODOS_SEQ.NEXTVAL , P_IDOPERADOR, TO_DATE(P_PERIODO,'DD/MM/RRRR'), TO_DATE(SYSDATE,'DD/MM/RRRR') + 5,1);
        P_RETORNO:='DEPOSITADOR HABILITA CERTIFICADO DE NO APLICACION';  
END PRD_CGG_HABILITAR_RETECIONES;

CREATE OR REPLACE PROCEDURE "PRD_CONVENIOS_ACT_ESTADO" AS idmotivo VARCHAR(10); idoperador VARCHAR(11); motivo VARCHAR(11); CURSOR v_obj_vencidos IS select FIS_CONVENIO_PAGO.IDCONVENIO_PAGO, count(INYM_DETALLE_BOLETAS.BOLETA_NRO) from FIS_CONVENIO_PAGO inner JOIN INYM_BOLETAS on INYM_BOLETAS.IDBOLETA = FIS_CONVENIO_PAGO.IDBOLETA inner join INYM_DETALLE_BOLETAS on INYM_DETALLE_BOLETAS.IDBOLETA = INYM_BOLETAS.IDBOLETA where INYM_DETALLE_BOLETAS.FECHA_PAGO is NULL and INYM_DETALLE_BOLETAS.FECHA_VENCIMIENTO < sysdate and FIS_CONVENIO_PAGO.IDESTADO_CONVENIO=1 group by FIS_CONVENIO_PAGO.IDCONVENIO_PAGO having count(INYM_DETALLE_BOLETAS.BOLETA_NRO) >= 3;
CURSOR v_obj_cancelados IS select * from ( select IDCONVENIO_PAGO, max(nvl(decode(tipo, 'P', cant),0)) PAGADO, max(decode(tipo, 'T', cant)) TOTAL FROM ( select c.IDCONVENIO_PAGO, count(INYM_DETALLE_BOLETAS.BOLETA_NRO) cant, 'T' TIPO from FIS_CONVENIO_PAGO c inner JOIN INYM_BOLETAS on INYM_BOLETAS.IDBOLETA = c.IDBOLETA inner join INYM_DETALLE_BOLETAS on INYM_DETALLE_BOLETAS.IDBOLETA = INYM_BOLETAS.IDBOLETA group by c.IDCONVENIO_PAGO union select c.IDCONVENIO_PAGO, count(INYM_DETALLE_BOLETAS.BOLETA_NRO), 'P' from FIS_CONVENIO_PAGO c inner JOIN INYM_BOLETAS on INYM_BOLETAS.IDBOLETA = c.IDBOLETA inner join INYM_DETALLE_BOLETAS on INYM_DETALLE_BOLETAS.IDBOLETA = INYM_BOLETAS.IDBOLETA where INYM_DETALLE_BOLETAS.FECHA_PAGO is not null group by c.IDCONVENIO_PAGO) GROUP BY IDCONVENIO_PAGO) where PAGADO = TOTAL;
CURSOR v_obj_caidos_90_d IS SELECT FIS_CONVENIO_PAGO.IDCONVENIO_PAGO, MAX(INYM_DETALLE_BOLETAS.FECHA_VENCIMIENTO) AS FECHA_VTO_ULT_CUOTA FROM FIS_CONVENIO_PAGO INNER JOIN INYM_BOLETAS ON INYM_BOLETAS.IDBOLETA = FIS_CONVENIO_PAGO.IDBOLETA INNER JOIN INYM_DETALLE_BOLETAS ON INYM_DETALLE_BOLETAS.IDBOLETA = INYM_BOLETAS.IDBOLETA WHERE FIS_CONVENIO_PAGO.IDESTADO_CONVENIO=1 GROUP BY FIS_CONVENIO_PAGO.IDCONVENIO_PAGO;
BEGIN FOR fila IN v_obj_vencidos LOOP update FIS_CONVENIO_PAGO SET IDESTADO_CONVENIO = 3 WHERE IDCONVENIO_PAGO = fila.IDCONVENIO_PAGO; END LOOP;
FOR fila IN v_obj_cancelados LOOP update FIS_CONVENIO_PAGO SET IDESTADO_CONVENIO = 2 WHERE IDCONVENIO_PAGO = fila.IDCONVENIO_PAGO; END LOOP;
FOR fila IN v_obj_caidos_90_d LOOP update FIS_CONVENIO_PAGO SET IDESTADO_CONVENIO = 3 WHERE IDCONVENIO_PAGO = fila.IDCONVENIO_PAGO AND (SYSDATE) - (fila.FECHA_VTO_ULT_CUOTA) >= 90; END LOOP;
END PRD_CONVENIOS_ACT_ESTADO ;

CREATE OR REPLACE PROCEDURE "PRD_CUPOS" (
    p_operador SIYM.DDJJ_DECLARACIONES.IDOPERADOR%TYPE,
    p_fecha VARCHAR2,
    p_tipo_cupo SIYM.ORD_CUPOS.IDTIPO_CUPO%TYPE,
    p_certificado SIYM.ORD_CUPOS.IDCERTIFICADO%TYPE,
    p_orden SIYM.ORD_CUPOS.ORDEN%TYPE,
    p_periodo VARCHAR2,
    p_motivo SIYM.ORD_CUPOS.MOTIVO%TYPE,
    p_kilos SIYM.ORD_CUPOS.KILOS%TYPE)
AS
  v_item SIYM.ORD_CUPOS.ITEM%TYPE;
  v_vigencia SIYM.ord_cupos.vigencia%TYPE;

  --SE CREA PARA CORREGUIR EL PROBLEMA DEL CUPO A PRINCIPIO DE MES, SOLO DDJJ DE AGOSTO
  v_correccion SIYM.ord_cupos.vigencia%TYPE;

  v_periodo VARCHAR2(10);

  --SE CREA PARA CORREGIR EL PROBLEMA DEL TIPO OCI_B_INT QUE EN LOS NULL LOS HACE 0
  v_motivo SIYM.ORD_CUPOS.MOTIVO%TYPE;
BEGIN
  v_periodo := p_periodo;  
  --DDJJ / DEDUCCION X CERTIFICADO / DEDUCCION X DDJJ
  IF p_tipo_cupo IN (1,3,4) THEN
    IF TO_DATE(p_periodo, 'RRRR-MM-DD') < TO_DATE('2011-08-01', 'RRRR-MM-DD') THEN
      v_vigencia := ADD_MONTHS(TO_DATE(p_periodo, 'RRRR-MM-DD'), 1);
    END IF;

    IF TO_DATE(p_periodo, 'RRRR-MM-DD') > TO_DATE('2011-08-01', 'RRRR-MM-DD') THEN
      v_vigencia := ADD_MONTHS(TO_DATE(p_periodo, 'RRRR-MM-DD'), 2);
    END IF;

    --SE CREA PARA CORREGUIR EL PROBLEMA DEL CUPO A PRINCIPIO DE MES, SOLO DDJJ DE AGOSTO
    IF p_tipo_cupo IN (1,4) AND p_periodo = '2011-08-01' THEN
      v_vigencia := ADD_MONTHS(TO_DATE(p_periodo, 'RRRR-MM-DD'), 1);
      v_correccion := ADD_MONTHS(TO_DATE(p_periodo, 'RRRR-MM-DD'), 2);
    END IF;

    IF p_tipo_cupo = 3 THEN
      v_periodo := NULL;
    END IF;
  END IF;

  --CERTIFICADOS / VENTA
  IF p_tipo_cupo IN (2,5) THEN
    v_vigencia := '01/' 
    || TO_CHAR(TO_DATE(p_fecha, 'RRRR-MM-DD'), 'MM/RRRR');
  END IF;

  --ANULACION DE VENTA
  IF p_tipo_cupo = 6 THEN
    SELECT emision INTO v_vigencia
    FROM SIYM.ord_emitidas
    WHERE orden = p_orden;

    v_vigencia := TO_DATE('01/' 
    || TO_CHAR(v_vigencia, 'MM/RRRR'), 'DD/MM/RRRR');
  END IF;

  IF p_tipo_cupo IN (2,5,6) THEN
    v_motivo := NULL;
  ELSE
    v_motivo := p_motivo;
  END IF;

  SELECT (MAX(item)+1)
  INTO v_item
  FROM siym.ord_cupos
  WHERE idoperador = p_operador
  AND vigencia = v_vigencia;

  IF v_item IS NULL THEN
    v_item := 1;
  END IF;

  --dbms_output.put_line ('IDOPERADOR:'||p_operador);
  --dbms_output.put_line ('PERIODO:'||v_periodo);
  --dbms_output.put_line ('MOTIVO:'||p_motivo);
  --dbms_output.put_line ('VIGENCIA:'||v_vigencia);
  --dbms_output.put_line ('FECHA:'||p_fecha);

  INSERT INTO siym.ord_cupos (idoperador, fecha, idtipo_cupo, idcertificado, orden, periodo, motivo, kilos, item, vigencia)
  VALUES (p_operador, TO_TIMESTAMP(p_fecha, 'RRRR-MM-DD'), p_tipo_cupo, p_certificado, p_orden, TO_TIMESTAMP(v_periodo, 'RRRR-MM-DD'), v_motivo, p_kilos, v_item, v_vigencia);

  --SE CREA PARA CORREGUIR EL PROBLEMA DEL CUPO A PRINCIPIO DE MES, SOLO DDJJ DE AGOSTO
  IF p_tipo_cupo IN (1,4) AND p_periodo = '2011-08-01' THEN
    SELECT (MAX(item)+1)
    INTO v_item
    FROM siym.ord_cupos
    WHERE idoperador = p_operador
    AND vigencia = '01/10/2011';

    IF v_item IS NULL THEN
      v_item := 1;
    END IF;

    INSERT INTO siym.ord_cupos (idoperador, fecha, idtipo_cupo, idcertificado, orden, periodo, motivo, kilos, item, vigencia)
    VALUES (p_operador, TO_TIMESTAMP(p_fecha, 'RRRR-MM-DD'), p_tipo_cupo, p_certificado, p_orden, TO_TIMESTAMP(v_periodo, 'RRRR-MM-DD'), v_motivo, p_kilos, v_item, v_correccion);
  END IF;
END;

CREATE OR REPLACE PROCEDURE PRD_DDJJ_VENCIMIENTO AS 
v_fecha DATE;
v_periodo DATE;
BEGIN
    v_periodo:= ADD_MONTHS(TRUNC(SYSDATE,'MONTH'),-1);
    v_fecha:=(fn_add_date(trunc(sysdate, 'month')+18,1)+1)- interval '1' second;

    insert into ddjj_vencimientos values (v_periodo, v_fecha, v_fecha);
END PRD_DDJJ_VENCIMIENTO;

CREATE OR REPLACE PROCEDURE PRD_DEL_DDJJ( p_idoperador siym.reg_operadores.idoperador%TYPE, p_periodo SIYM.ddjj_declaraciones.periodo%TYPE, p_motivo SIYM.ddjj_declaraciones.motivo%TYPE ) AS BEGIN --PLANTA DELETE FROM SIYM.ddjj_ingresos WHERE idoperador = p_idoperador AND periodo = p_periodo AND motivo = p_motivo;
DELETE FROM SIYM.ddjj_salidas WHERE idoperador = p_idoperador AND periodo = p_periodo AND motivo = p_motivo;
DELETE FROM SIYM.ddjj_stock WHERE idoperador = p_idoperador AND periodo = p_periodo AND motivo = p_motivo;
DELETE FROM SIYM.ddjj_stock_ter WHERE idoperador = p_idoperador AND periodo = p_periodo AND motivo = p_motivo;
DELETE FROM SIYM.ddjj_balances WHERE idoperador = p_idoperador AND periodo = p_periodo AND motivo = p_motivo;
DELETE FROM SIYM.ddjj_hojas_rutas WHERE idoperador = p_idoperador AND periodo = p_periodo AND motivo = p_motivo;
DELETE FROM SIYM.ddjj_ajustes WHERE idoperador = p_idoperador AND periodo = p_periodo AND motivo = p_motivo;
DELETE FROM SIYM.exp_notas_ddjj WHERE idoperador = p_idoperador AND periodo = p_periodo AND motivo = p_motivo;
DELETE FROM SIYM.ddjj_leyendas_declaraciones WHERE idoperador = p_idoperador AND periodo = p_periodo AND motivo = p_motivo;
DELETE FROM SIYM.ord_cupos WHERE idoperador = p_idoperador AND periodo = p_periodo AND motivo = p_motivo;
DELETE FROM SIYM.ddjj_declaraciones WHERE idoperador = p_idoperador AND periodo = p_periodo AND motivo = p_motivo; END;

CREATE OR REPLACE PROCEDURE PRD_ELI_ORD(
    p_orden  in siym.ord_emitidas.orden%type ,
    p_motivo in siym.ord_motivos_eli.idmotivo_eli%type,
    p_idusuario in siym.ord_emitidas_historico.idusuario%type,
    p_retorno OUT VARCHAR)
AS

v_orden siym.ord_emitidas.orden%TYPE;
v_kilos siym.ord_cupos.kilos%TYPE;
v_idoperador SIYM.reg_operadores.idoperador%TYPE;

BEGIN

/*
  1	VENCIDA
  2	FALLA DEL PROCESO
  3	MAL CONFECCIONADA
*/

  BEGIN
    SELECT orden
    INTO v_orden
    FROM siym.ord_emitidas
    WHERE orden = p_orden;
  EXCEPTION

  WHEN NO_DATA_FOUND THEN
    v_orden := NULL;
  END;

  IF v_orden IS NOT NULL THEN
    UPDATE siym.ord_emitidas
    SET eliminada = 1
    WHERE orden = p_orden;

    INSERT INTO SIYM.ord_eliminadas
    (orden,idmotivo_eli,fecha)
    VALUES (p_orden, p_motivo, TO_TIMESTAMP(TO_CHAR(SYSDATE,'DD-MM-RRRR'), 'DD-MM-RRRR'));

    INSERT INTO SIYM.ord_emitidas_historico (
    id_historico,
    fecha,
    idestado,
    orden,
    idusuario
        ) VALUES (
            SIYM.ORD_EMITIDAS_HISTORICO_SEQ.nextval,
            sysdate,
            10,
            p_orden,
            p_idusuario
        );

    SELECT kilos
    INTO v_kilos
    FROM ord$_orden_kilos
    WHERE orden = p_orden;

    SELECT idoperador
    INTO v_idoperador
    FROM ord$_orden_kilos
    WHERE orden = p_orden;

    SIYM.prd_cupos(v_idoperador , TO_CHAR(SYSDATE,'RRRR-MM-DD'), 6, NULL, p_orden, NULL, NULL, v_kilos) ;
    p_retorno:='Orden N ' || p_orden || ' eliminada correctamente';
  ELSE
    dbms_output.put_line ('La orden N ' || p_orden || ' no se encuentra cargada');
    p_retorno:='La orden N ' || p_orden || ' no se encuentra cargada.';
  END IF;

END PRD_ELI_ORD;

CREATE OR REPLACE PROCEDURE PRD_ELIMINAR_BOLETA( P_IDBOLETA NUMBER, P_IDUSUARIO NUMBER, P_MOTIVO_ELIMINA VARCHAR2, P_RETORNO OUT VARCHAR ) AS
IDBOLETA_INSERTED NUMBER; CONTADOR_DETALLE_BOL NUMBER;
CURSOR CUR_INYM_BOLETAS IS SELECT --INYM_BOLETA BOL.IDBOLETA, BOL.IDCONVENIO, BOL.IDTIPOBOLETA, BOL.IDOPERADOR, BOL.NOMBRE, BOL.IDUSUARIO, BOL.IDTIPO_REGISTRO, BOL.FECHA_EMISION, BOL.IDNOTA_DDJJ, BOL.IDEXPEDIENTE, BOL.NRO_RESOLUCION, --INYM_DETALLE_BOLETA BOL_DET.CUOTA, BOL_DET.BOLETA_NRO, BOL_DET.IDFORMA_PAGO, BOL_DET.FECHA_VENCIMIENTO, BOL_DET.IMPORTE, BOL_DET.FECHA_PAGO, BOL_DET.IDSUCURSAL, BOL_DET.IDBANCO
FROM SIYM.INYM_BOLETAS BOL INNER JOIN SIYM.INYM_DETALLE_BOLETAS BOL_DET ON BOL.IDBOLETA = BOL_DET.IDBOLETA AND BOL_DET.FECHA_PAGO IS NULL WHERE BOL.IDBOLETA = P_IDBOLETA ORDER BY SIYM.BOL_DET.CUOTA ASC;
BEGIN CONTADOR_DETALLE_BOL := 0;
FOR FILA_BOLETA IN CUR_INYM_BOLETAS LOOP
--INSERTA EN EL LOOP POR UNICA VEZ UN REGISTRO DE INYM_BOLETAS_ELIMINADAS (ENCABEZADO DE LA BOLETA) IF CONTADOR_DETALLE_BOL=0 THEN INSERT INTO SIYM.INYM_BOLETAS_ELIMINADAS ( IDBOLETA, IDCONVENIO, IDTIPOBOLETA, IDOPERADOR, NOMBRE, IDUSUARIO, IDTIPO_REGISTRO, FECHA_EMISION, IDNOTA_DDJJ, IDEXPEDIENTE, NRO_RESOLUCION, FECHA_ELIMINACION, IDUSUARIO_ELIMINA, MOTIVO_ELIMINA) VALUES ( FILA_BOLETA.IDBOLETA, FILA_BOLETA.IDCONVENIO, FILA_BOLETA.IDTIPOBOLETA, FILA_BOLETA.IDOPERADOR, FILA_BOLETA.NOMBRE, FILA_BOLETA.IDUSUARIO, FILA_BOLETA.IDTIPO_REGISTRO, FILA_BOLETA.FECHA_EMISION, FILA_BOLETA.IDNOTA_DDJJ, FILA_BOLETA.IDEXPEDIENTE, FILA_BOLETA.NRO_RESOLUCION, SYSDATE, P_IDUSUARIO, P_MOTIVO_ELIMINA )
RETURNING FILA_BOLETA.IDBOLETA INTO IDBOLETA_INSERTED;
CONTADOR_DETALLE_BOL := CONTADOR_DETALLE_BOL+1; END IF;
--INSERTA POR CADA ITERACION DEL LOOP UN DETALLE DE BOLETA INSERT INTO SIYM.INYM_DETALLE_BOLETAS_ELIMINADAS (CUOTA, IDBOLETA, BOLETA_NRO, IDFORMA_PAGO, FECHA_VENCIMIENTO, IMPORTE, FECHA_PAGO, IDSUCURSAL, IDBANCO) VALUES (FILA_BOLETA.CUOTA, IDBOLETA_INSERTED, FILA_BOLETA.BOLETA_NRO, FILA_BOLETA.IDFORMA_PAGO, FILA_BOLETA.FECHA_VENCIMIENTO, FILA_BOLETA.IMPORTE, FILA_BOLETA.FECHA_PAGO, FILA_BOLETA.IDSUCURSAL, FILA_BOLETA.IDBANCO); END LOOP;
IF CONTADOR_DETALLE_BOL > 0 THEN DELETE FROM SIYM.INYM_DETALLE_BOLETAS WHERE IDBOLETA=P_IDBOLETA; DELETE FROM SIYM.INYM_BOLETAS WHERE IDBOLETA=P_IDBOLETA; END IF;
P_RETORNO:='Boleta eliminada correctamente';
EXCEPTION WHEN OTHERS THEN ROLLBACK; DBMS_OUTPUT.PUT_LINE ('ERROR AL ELIMINAR BOLETA '|| SQLERRM ); P_RETORNO:='Error al eliminadar la Boleta. IDBOLETA: '|| P_IDBOLETA;
END;

CREATE OR REPLACE PROCEDURE PRD_EST_ENTREGAS_DETALLES_CARGA ( P_IDENTREGA NUMBER, P_RETORNO OUT VARCHAR ) AS
EST_ENTREGAS_ESTADOS_PENDIENTE NUMBER;
CURSOR CUR_EST_PACKING IS SELECT DISTINCT PKN.IDENTREGA, PKN.IDCODIGO, PKN.IDSERIE, PKN.CAJA FROM SIYM.EST_PACKING PKN INNER JOIN EST_ENTREGAS ENT ON ENT.IDENTREGA = PKN.IDENTREGA WHERE ENT.IDENTREGA=P_IDENTREGA AND ENT.IDENTREGA NOT IN (SELECT IDENTREGA FROM SIYM.EST_ENTREGAS_DETALLES ENT_DET) ;
BEGIN
EST_ENTREGAS_ESTADOS_PENDIENTE := 1;
FOR FILA_PACKING IN CUR_EST_PACKING LOOP INSERT INTO SIYM.EST_ENTREGAS_DETALLES ( IDENTREGA_DETALLE, IDESTADO, IDENTREGA, IDCODIGO, IDSERIE, CAJA ) VALUES ( EST_ENTREGAS_DETALLES_SEQ.NEXTVAL, EST_ENTREGAS_ESTADOS_PENDIENTE, FILA_PACKING.IDENTREGA, FILA_PACKING.IDCODIGO, FILA_PACKING.IDSERIE, FILA_PACKING.CAJA );
END LOOP;
P_RETORNO:='est_entregas_detalles insercion correcta';
EXCEPTION WHEN OTHERS THEN ROLLBACK; DBMS_OUTPUT.PUT_LINE ('ERROR AL INSERTAR EST_ENTREGAS_DETALLES '|| SQLERRM ); P_RETORNO:='Error al insertar EST_ENTREGAS_DETALLES '|| P_IDENTREGA; END;

CREATE OR REPLACE PROCEDURE PRD_EST_PAGOS(
    p_fecha_pago DATE,
    p_boletanro INTEGER,
    p_importe FLOAT,
    p_idforma_pago INTEGER,
    p_idusuario INTEGER,
    p_retorno OUT VARCHAR)
AS
  v_total FLOAT;
  v_idboleta INTEGER;

BEGIN
    BEGIN
      select inym_detalle_boletas.idboleta, inym_detalle_boletas.importe into v_idboleta, v_total from inym_detalle_boletas inner join inym_boletas on inym_boletas.idboleta = inym_detalle_boletas.idboleta
        where boleta_nro = p_boletanro and inym_boletas.idtipoboleta = 4 and inym_detalle_boletas.fecha_pago is null and inym_detalle_boletas.idforma_pago=p_idforma_pago;
      dbms_output.put_line('IDBOLETA:'||v_idboleta);
      IF v_total <> p_importe THEN
        p_retorno:='El importe pagado no corresponde a la boleta.';
      ELSE
        UPDATE inym_detalle_boletas SET inym_detalle_boletas.fecha_pago = p_fecha_pago,
        idusuario_carga_pago = sys_context('USERENV','SESSION_USERID'),
        fecha_carga_pago = sysdate
        WHERE inym_detalle_boletas.idboleta = v_idboleta AND inym_detalle_boletas.boleta_nro=p_boletanro;

        dbms_output.put_line('Actualizados:'||SQL%ROWCOUNT);

        IF SQL%FOUND THEN
          INSERT INTO SIYM.ord_emitidas_historico (
                id_historico,
                fecha,
                idestado,
                orden,
                idusuario,
                observaciones
            ) VALUES (
                SIYM.ORD_EMITIDAS_HISTORICO_SEQ.nextval,
                sysdate,
                5,
                p_boletanro,
                p_idusuario,
                ''
            );
        ELSE
          p_retorno:='ERROR: No se pudo cargar el pago.';
        END IF;
        p_retorno:='Pago Cargado.';
      END IF;
    EXCEPTION
      WHEN NO_DATA_FOUND THEN
        p_retorno:='No se pudo cargar el pago.';
    END;

END;

CREATE OR REPLACE PROCEDURE PRD_EST_PAGOS_CHEQUE(
    p_fecha_pago DATE,
    p_boletanro INTEGER,
    p_importe FLOAT,
    p_idforma_pago INTEGER,
    p_nro_cheque VARCHAR,
    p_bco_cheque VARCHAR,
    p_venc_cheque VARCHAR,
    p_idusuario INTEGER,
    p_retorno OUT VARCHAR)
AS
  v_total FLOAT;
  v_idboleta INTEGER;
  v_nro_cheque VARCHAR(100);
  v_bco_cheque VARCHAR(100);
  v_fecha_cheque VARCHAR(100);
  v_venc_cheque VARCHAR(100);
  v_importe_cheque VARCHAR(100);
  v_venc_cheque_habil VARCHAR(100) := null;

BEGIN
    BEGIN

      select NRO_CHEQUE, IDBANCO, FECHA_CHEQUE, VENC_CHEQUE, IMPORTE 
         into v_nro_cheque, v_bco_cheque, v_fecha_cheque, v_venc_cheque, v_importe_cheque
         from ord_cheques
         where orden = p_boletanro;

      BEGIN
        select fn_add_date(to_date(v_venc_cheque,'DD/MM/YYYY'),1) into v_venc_cheque_habil from dual 
            where EXISTS (SELECT * from inym_nolaborales where inym_nolaborales.fecha = to_date(v_venc_cheque,'DD/MM/YYYY') )
            or to_char(to_date(v_venc_cheque),'D') IN ('6','7');
      EXCEPTION
        WHEN NO_DATA_FOUND THEN
            v_venc_cheque_habil := v_venc_cheque;
      END;

      IF v_nro_cheque <> p_nro_cheque THEN
        p_retorno:='El nro del cheque no corresponde a lo declarado.' || 'Declarado: ' || v_nro_cheque || 'Rendido: ' || p_nro_cheque;
      END IF;

      IF v_bco_cheque <> p_bco_cheque THEN
        p_retorno:= p_retorno || 'El banco del cheque no corresponde a lo declarado.'|| 'Declarado: ' || v_bco_cheque || 'Rendido: ' || p_bco_cheque;
      END IF;

      IF v_venc_cheque_habil <> p_venc_cheque THEN
        p_retorno:= p_retorno || 'El vencimiento del cheque no corresponde a lo declarado.'|| 'Declarado: ' || v_venc_cheque || 'Rendido: ' || p_venc_cheque;
      END IF;

      select inym_detalle_boletas.idboleta, inym_detalle_boletas.importe into v_idboleta, v_total from inym_detalle_boletas inner join inym_boletas on inym_boletas.idboleta = inym_detalle_boletas.idboleta
        where boleta_nro = p_boletanro and inym_boletas.idtipoboleta = 4 and inym_detalle_boletas.fecha_pago is null and inym_detalle_boletas.idforma_pago=p_idforma_pago;
      dbms_output.put_line('IDBOLETA:'||v_idboleta);

      IF v_total <> p_importe THEN
        p_retorno:= p_retorno || 'El importe pagado no corresponde a la boleta.';
      END IF;

      IF v_total = p_importe AND  v_nro_cheque = p_nro_cheque AND v_bco_cheque = p_bco_cheque AND v_venc_cheque_habil = p_venc_cheque THEN

        UPDATE inym_detalle_boletas SET inym_detalle_boletas.fecha_pago = p_fecha_pago,
        idusuario_carga_pago = sys_context('USERENV','SESSION_USERID'),
        fecha_carga_pago = sysdate
        WHERE inym_detalle_boletas.idboleta = v_idboleta AND inym_detalle_boletas.boleta_nro=p_boletanro;

        dbms_output.put_line('Actualizados:'||SQL%ROWCOUNT);


        IF SQL%FOUND THEN
          INSERT INTO SIYM.ord_emitidas_historico (
                id_historico,
                fecha,
                idestado,
                orden,
                idusuario,
                observaciones
            ) VALUES (
                SIYM.ORD_EMITIDAS_HISTORICO_SEQ.nextval,
                sysdate,
                5,
                p_boletanro,
                p_idusuario,
                ''
            );
            p_retorno:='Pago Cargado.';
        ELSE
          p_retorno:='ERROR: No se pudo cargar el pago.';
        END IF;

      END IF;
    EXCEPTION
      WHEN NO_DATA_FOUND THEN
        p_retorno:='No se pudo cargar el pago.';
    END;

END;

CREATE OR REPLACE PROCEDURE PRD_GENERAR_NOPRES ( P_PERIODO IN DATE ) AS
nro_exp VARCHAR(10); nro_nota VARCHAR(11); nro_planilla VARCHAR(11); CURSOR v_obj_no_pres IS select idoperador from reg_operadores where IDTIPO_OPERADOR <>1 and FN_VERIF_PERIODO(idoperador,TO_CHAR(P_PERIODO,'yyyy-mm-dd') )=1 AND idoperador NOT IN (SELECT "SIYM"."DDJJ_DECLARACIONES"."IDOPERADOR" FROM "SIYM"."DDJJ_DECLARACIONES" WHERE ( ( "SIYM"."DDJJ_DECLARACIONES"."PERIODO" = P_PERIODO ) AND ( "SIYM"."DDJJ_DECLARACIONES"."MOTIVO" = '0' ) ) ) and idoperador not in (select idoperador from exp_nota_nopres where periodo = P_PERIODO) ORDER BY idoperador;
CURSOR v_obj_habilita IS SELECT "SIYM"."EXP_NOTA_NOPRES".IDOPERADOR, "SIYM"."EXP_NOTA_NOPRES".PERIODO
FROM "SIYM"."EXP_NOTA_NOPRES" INNER JOIN "SIYM"."REG_OPERADORES" ON ( "SIYM"."REG_OPERADORES"."IDOPERADOR" = "SIYM"."EXP_NOTA_NOPRES". "IDOPERADOR" ) WHERE "SIYM"."REG_OPERADORES"."IDTIPO_OPERADOR" IN (6,8,10) AND PERIODO = P_PERIODO; BEGIN SELECT EXP_PLANILLA_NOPRES_SEQ.nextval || '/' || EXTRACT(YEAR FROM sysdate) INTO nro_planilla FROM DUAL; INSERT INTO EXP_PLANILLA_NOPRES ( IDPLANILLA_NOPRES, FECHA ) VALUES ( nro_planilla, sysdate ); FOR fila IN v_obj_no_pres LOOP BEGIN SELECT DISTINCT "SIYM"."EXP_HIST_EXPEDIENTES"."IDEXPEDIENTE" INTO nro_exp FROM "SIYM"."EXP_EXPEDIENTES" INNER JOIN "SIYM"."EXP_HIST_EXPEDIENTES" ON "SIYM"."EXP_HIST_EXPEDIENTES"."IDEXPEDIENTE" = "SIYM"."EXP_EXPEDIENTES". "IDEXPEDIENTE" WHERE ( (SUBSTR("SIYM"."EXP_HIST_EXPEDIENTES"."IDEXPEDIENTE",-4,4)=EXTRACT(YEAR FROM sysdate) OR SUBSTR("SIYM"."EXP_HIST_EXPEDIENTES"."IDEXPEDIENTE", -4,4)=EXTRACT(YEAR FROM P_PERIODO)) AND "SIYM"."EXP_EXPEDIENTES"."IDTIPO_REGISTRO" =1 AND "SIYM"."EXP_EXPEDIENTES"."REGISTRO" =to_char(fila.IDOPERADOR) AND ( "SIYM"."EXP_HIST_EXPEDIENTES"."IDTIPO_ESCRITO" =1 OR "SIYM"."EXP_HIST_EXPEDIENTES"."IDTIPO_ESCRITO" =2 ) ) ; EXCEPTION WHEN NO_DATA_FOUND THEN SELECT INYM_EXPEDIENTES_SEQ.nextval || '/' || EXTRACT(YEAR FROM SYSDATE) INTO nro_exp FROM DUAL; INSERT INTO SIYM.EXP_EXPEDIENTES ( SIYM.EXP_EXPEDIENTES.IDEXPEDIENTE, IDTIPO_EXPEDIENTE, IDTIPO_REGISTRO, REGISTRO, FECHA ) VALUES ( nro_exp, 1,1, fila.IDOPERADOR, sysdate ); WHEN TOO_MANY_ROWS THEN SELECT DISTINCT "SIYM"."EXP_HIST_EXPEDIENTES"."IDEXPEDIENTE" INTO nro_exp FROM "SIYM"."EXP_EXPEDIENTES" INNER JOIN "SIYM"."EXP_HIST_EXPEDIENTES" ON "SIYM"."EXP_HIST_EXPEDIENTES"."IDEXPEDIENTE" = "SIYM"."EXP_EXPEDIENTES". "IDEXPEDIENTE" WHERE ( SUBSTR("SIYM"."EXP_HIST_EXPEDIENTES"."IDEXPEDIENTE",-4,4)=EXTRACT(YEAR FROM P_PERIODO) AND "SIYM"."EXP_EXPEDIENTES"."IDTIPO_REGISTRO" =1 AND "SIYM"."EXP_EXPEDIENTES"."REGISTRO" =fila.IDOPERADOR AND ( "SIYM"."EXP_HIST_EXPEDIENTES"."IDTIPO_ESCRITO" =1 OR "SIYM"."EXP_HIST_EXPEDIENTES"."IDTIPO_ESCRITO" =2 ) ) ; END ; SELECT EXP_NOTA_NOPRES_SEQ.nextval || '/' || EXTRACT(YEAR FROM sysdate) INTO nro_nota FROM DUAL; INSERT INTO SIYM.EXP_NOTA_NOPRES ( IDNOTA_NOPRES, FECHA, IDOPERADOR, PERIODO, IDPLANILLA_NOPRES ) VALUES ( nro_nota, sysdate, fila.IDOPERADOR, P_PERIODO, nro_planilla ); INSERT INTO SIYM.EXP_HIST_EXPEDIENTES ( IDEXPEDIENTE, FECHA, IDTIPO_ESCRITO, ESCRITO ) VALUES ( nro_exp, sysdate, 2, nro_nota ); END LOOP;
FOR fila IN v_obj_habilita LOOP PRD_INHABILITACIONES(2, fila.IDOPERADOR, TO_CHAR(fila.PERIODO,'yyyy-mm-dd'), 0, 185, 'I'); END LOOP; END PRD_GENERAR_NOPRES;

CREATE OR REPLACE PROCEDURE PRD_HABILITAR_PRODUCTOR(
    P_OPERADOR        IN SIYM.reg_operadores.idoperador%TYPE,
    P_IDUSUARIO       IN NUMBER
     )
AS

V_IDTIPO_OPERADOR SIYM.reg_tipos_operadores.idtipo_operador%TYPE;

BEGIN

  BEGIN
    SELECT REG$_OPERADORES2.IDTIPO_OPERADOR
    INTO V_IDTIPO_OPERADOR
    FROM SIYM.REG$_OPERADORES2
    WHERE REG$_OPERADORES2.IDOPERADOR = P_OPERADOR;

  EXCEPTION

  WHEN NO_DATA_FOUND THEN
    V_IDTIPO_OPERADOR := NULL;
  END;

  IF V_IDTIPO_OPERADOR  IS NOT NULL THEN
    IF V_IDTIPO_OPERADOR = 1 THEN
      UPDATE REG_INHABILITACIONES_EXTRAS
      SET FECHA_HABILITACION = SYSDATE,
        IDUSUARIO_HABILITA   = P_IDUSUARIO
      WHERE IDMOTIVO_INHAB   = 7
      AND IDOPERADOR         = P_OPERADOR;
    ELSE
      UPDATE REG_INHABILITACIONES_EXTRAS
      SET FECHA_HABILITACION = SYSDATE,
        IDUSUARIO_HABILITA   = P_IDUSUARIO
      WHERE IDMOTIVO_INHAB   = 11
      AND IDOPERADOR         = P_OPERADOR;
    END IF;
  END IF;
END PRD_HABILITAR_PRODUCTOR;

CREATE OR REPLACE PROCEDURE "PRD_INHABILITACIONES" ( p_idmotivo_inhab SIYM.reg_motivo_inhab.idmotivo_inhab%TYPE, p_idoperador SIYM.ddjj_declaraciones.idoperador%TYPE, p_periodo VARCHAR, p_motivo SIYM.ddjj_declaraciones.motivo%TYPE, p_idusuario_habilita SIYM.reg_inhabilitaciones.idusuario_habilita%TYPE, p_tipo VARCHAR ) AS
v_inhabilitaciones number; --v_idnota_7_11 siym.exp_notas_7_11.idnota_7_11%type;
BEGIN
IF p_tipo = 'U' THEN UPDATE SIYM.reg_inhabilitaciones SET fecha_habilitacion = TO_TIMESTAMP(TO_CHAR(SYSDATE,'DD-MM-RRRR HH24:MI:SS'), 'DD-MM-RRRR HH24:MI:SS'), idusuario_habilita = p_idusuario_habilita WHERE idmotivo_inhab = p_idmotivo_inhab AND idoperador = p_idoperador AND periodo = TO_TIMESTAMP(p_periodo, 'YYYY-MM-DD') AND motivo = p_motivo;
UPDATE SIYM.reg_inhabilitaciones_extras SET fecha_habilitacion = TO_TIMESTAMP(TO_CHAR(SYSDATE,'DD-MM-RRRR HH24:MI:SS'), 'DD-MM-RRRR HH24:MI:SS'), idusuario_habilita = p_idusuario_habilita WHERE idmotivo_inhab = p_idmotivo_inhab AND fecha_habilitacion IS NULL AND idoperador = p_idoperador;
SELECT COUNT(idoperador) INTO v_inhabilitaciones FROM SIYM.reg_inhabilitaciones WHERE idoperador = p_idoperador AND fecha_habilitacion IS NULL AND idmotivo_inhab NOT IN (5,6);
IF v_inhabilitaciones = 0 THEN SELECT COUNT(idoperador) INTO v_inhabilitaciones FROM SIYM.reg_inhabilitaciones WHERE idoperador = p_idoperador and fecha_habilitacion is null and fecha_notificacion is not null and months_between(trunc(sysdate,'MONTH'),trunc(add_months(fecha_notificacion, 1), 'MONTH')) >= 1 and idoperador in ( select idoperador from siym.reg_operadores where idtipo_operador not in (6,8,10) ) AND idmotivo_inhab IN (5,6); END IF;
IF v_inhabilitaciones = 0 THEN SELECT COUNT(idoperador) INTO v_inhabilitaciones FROM SIYM.reg_inhabilitaciones_extras WHERE idoperador = p_idoperador AND fecha_habilitacion IS NULL AND idmotivo_inhab IN (8,10,12,13,14,15,18,19); END IF;
IF v_inhabilitaciones = 0 THEN UPDATE SIYM.reg_operadores SET inhabilitado = 0 WHERE idoperador = p_idoperador; END IF; END IF;
IF p_tipo = 'I' THEN IF TO_TIMESTAMP(p_periodo, 'YYYY-MM-DD') <= TO_TIMESTAMP('2011-02-01', 'YYYY-MM-DD') AND p_idmotivo_inhab IN (1,2,3,4) THEN IF p_idmotivo_inhab = 4 THEN UPDATE SIYM.reg_inhabilitaciones SET fecha_habilitacion = TO_TIMESTAMP(TO_CHAR(SYSDATE,'DD-MM-RRRR HH24:MI:SS'), 'DD-MM-RRRR HH24:MI:SS'), idusuario_habilita = p_idusuario_habilita WHERE idmotivo_inhab = 2 AND idoperador = p_idoperador AND periodo = TO_TIMESTAMP(p_periodo, 'YYYY-MM-DD') AND motivo = p_motivo; END IF;
INSERT INTO SIYM.reg_inhabilitaciones (idmotivo_inhab, idoperador, periodo, motivo, fecha, fecha_habilitacion, idusuario_habilita) VALUES (p_idmotivo_inhab, p_idoperador, TO_TIMESTAMP(p_periodo, 'YYYY-MM-DD'), p_motivo, TO_TIMESTAMP(TO_CHAR(SYSDATE,'DD-MM-RRRR HH24:MI:SS'), 'DD-MM-RRRR HH24:MI:SS'), NULL, NULL);
UPDATE SIYM.reg_operadores SET inhabilitado = 1 WHERE idoperador = p_idoperador; ELSE IF TO_TIMESTAMP(p_periodo, 'YYYY-MM-DD') >= TO_TIMESTAMP('2011-03-01', 'YYYY-MM-DD') AND p_idmotivo_inhab NOT IN (5,6) THEN IF p_idmotivo_inhab = 4 OR p_idmotivo_inhab = 2 THEN IF p_idmotivo_inhab = 4 THEN UPDATE SIYM.reg_inhabilitaciones SET fecha_habilitacion = TO_TIMESTAMP(TO_CHAR(SYSDATE,'DD-MM-RRRR HH24:MI:SS'), 'DD-MM-RRRR HH24:MI:SS'), idusuario_habilita = p_idusuario_habilita WHERE idmotivo_inhab = 2 AND idoperador = p_idoperador AND periodo = TO_TIMESTAMP(p_periodo, 'YYYY-MM-DD') AND motivo = p_motivo; END IF; END IF; INSERT INTO SIYM.reg_inhabilitaciones (idmotivo_inhab, idoperador, periodo, motivo, fecha, fecha_habilitacion, idusuario_habilita) VALUES (p_idmotivo_inhab, p_idoperador, TO_TIMESTAMP(p_periodo, 'YYYY-MM-DD'), p_motivo, TO_TIMESTAMP(TO_CHAR(SYSDATE,'DD-MM-RRRR HH24:MI:SS'), 'DD-MM-RRRR HH24:MI:SS'), NULL, NULL);
UPDATE SIYM.reg_operadores SET inhabilitado = 1 WHERE idoperador = p_idoperador; ELSE IF p_idmotivo_inhab=10 THEN INSERT INTO SIYM.reg_inhabilitaciones_extras (idmotivo_inhab, idoperador, fecha) VALUES (p_idmotivo_inhab, p_idoperador, SYSDATE); UPDATE SIYM.reg_operadores SET inhabilitado = 1 WHERE idoperador = p_idoperador;
ELSE INSERT INTO SIYM.reg_inhabilitaciones (idmotivo_inhab, idoperador, periodo, motivo, fecha, fecha_habilitacion, idusuario_habilita) VALUES (p_idmotivo_inhab, p_idoperador, TO_TIMESTAMP(p_periodo, 'YYYY-MM-DD'), p_motivo, TO_TIMESTAMP(TO_CHAR(SYSDATE,'DD-MM-RRRR HH24:MI:SS'), 'DD-MM-RRRR HH24:MI:SS'), NULL, NULL); END IF; END IF; end if; END IF;
if p_tipo = 'N' then if to_timestamp(p_periodo, 'YYYY-MM-DD') >= to_timestamp('2011-03-01', 'YYYY-MM-DD') and p_idmotivo_inhab in (5,6) then update siym.reg_inhabilitaciones set fecha_notificacion = to_timestamp(to_char(sysdate,'DD-MM-RRRR'), 'DD-MM-RRRR') where idmotivo_inhab in (5,6) AND idoperador = p_idoperador and periodo = to_timestamp(p_periodo, 'YYYY-MM-DD') AND motivo = p_motivo;
UPDATE SIYM.reg_operadores set inhabilitado = 1 WHERE idoperador = p_idoperador; end if; END IF; END PRD_INHABILITACIONES;

CREATE OR REPLACE PROCEDURE PRD_MIGRA_BOL_VIEJA_CONV ( p_idconvenio number ) AS CURSOR C_MIGRA_BOLETAS IS SELECT SIYM.INYM$_REGISTROS.IDREGISTRO, SIYM.INYM$_REGISTROS.IDTIPO_REGISTRO, SIYM.INYM$_REGISTROS.NOMBRE, SIYM.TMP_MIGRA_BOLETAS.FECHA_EMISION, SIYM.FIS_CONVENIO_PAGO.IDEXPEDIENTE, (SELECT FIS_INFRACTORES.RESOLUCION FROM SIYM.FIS_INFRACTORES WHERE SIYM.FIS_INFRACTORES.IDCONVENIO_PAGO=p_idconvenio AND ROWNUM=1) AS RESOLUCION, SIYM.TMP_MIGRA_BOLETAS.CUOTA, SIYM.TMP_MIGRA_BOLETAS.BOLETA_NRO, SIYM.TMP_MIGRA_BOLETAS.FECHA_VENCIMIENTO, SIYM.TMP_MIGRA_BOLETAS.IMPORTE, SIYM.TMP_MIGRA_BOLETAS.FECHA_PAGO FROM SIYM.TMP_MIGRA_BOLETAS INNER JOIN SIYM.INYM$_REGISTROS ON SIYM.INYM$_REGISTROS.IDREGISTRO = SIYM.TMP_MIGRA_BOLETAS.IDOPERADOR AND SIYM.INYM$_REGISTROS.IDTIPO_REGISTRO =SIYM.TMP_MIGRA_BOLETAS.IDTIPO_REGISTRO INNER JOIN SIYM.FIS_CONVENIO_PAGO ON SIYM.FIS_CONVENIO_PAGO.IDCONVENIO_PAGO=SIYM.TMP_MIGRA_BOLETAS.IDCONVENIO_PAGO WHERE SIYM.FIS_CONVENIO_PAGO.IDCONVENIO_PAGO = p_idconvenio ORDER BY SIYM.TMP_MIGRA_BOLETAS.CUOTA ASC;
BEGIN
FOR FILA_BOLETA IN C_MIGRA_BOLETAS LOOP
IF FILA_BOLETA.CUOTA=1 THEN INSERT INTO SIYM.INYM_BOLETAS (IDBOLETA, IDCONVENIO, IDTIPOBOLETA, IDOPERADOR, NOMBRE, IDUSUARIO, IDTIPO_REGISTRO, FECHA_EMISION, IDEXPEDIENTE, NRO_RESOLUCION) VALUES (SIYM.INYM_BOLETAS_SEQ.NEXTVAL, 4, 1, --IDCONVENIO=4 (INYM - RECAUDACIONES VARIAS), IDTIPOBOLETA=1 (MULTAS) FILA_BOLETA.IDREGISTRO, UPPER(FILA_BOLETA.NOMBRE), 92, FILA_BOLETA.IDTIPO_REGISTRO, FILA_BOLETA.FECHA_EMISION, FILA_BOLETA.IDEXPEDIENTE, FILA_BOLETA.RESOLUCION);
UPDATE SIYM.FIS_CONVENIO_PAGO SET SIYM.FIS_CONVENIO_PAGO.IDBOLETA =SIYM.INYM_BOLETAS_SEQ.CURRVAL WHERE SIYM.FIS_CONVENIO_PAGO.IDCONVENIO_PAGO = p_idconvenio ;
END IF;
INSERT INTO SIYM.INYM_DETALLE_BOLETAS (CUOTA, IDBOLETA, BOLETA_NRO, IDFORMA_PAGO, FECHA_VENCIMIENTO, IMPORTE, FECHA_PAGO) VALUES (FILA_BOLETA.CUOTA, SIYM.INYM_BOLETAS_SEQ.CURRVAL, FILA_BOLETA.BOLETA_NRO, 1, FILA_BOLETA.FECHA_VENCIMIENTO, FILA_BOLETA.IMPORTE, --IDFORMA_PAGO=4 (BANCO MACRO) FILA_BOLETA.FECHA_PAGO); END LOOP;
PRD_CONVENIOS_ACT_ESTADO();
END PRD_MIGRA_BOL_VIEJA_CONV ;

CREATE OR REPLACE PROCEDURE "PRD_MIGRA_DDJJ"(
    P_IDOPERADOR  SIYM.DDJJ_DECLARACIONES.IDOPERADOR%TYPE,
    P_PERIODO_INI SIYM.DDJJ_DECLARACIONES.PERIODO%TYPE,
    P_PERIODO_FIN SIYM.DDJJ_DECLARACIONES.PERIODO%TYPE
    )

AS
  CURSOR c_ctrl
  IS
    SELECT SIYM.DDJJ_DECLARACIONES.IDOPERADOR,
      SIYM.DDJJ_DECLARACIONES.PERIODO,
      siym.ddjj_declaraciones.motivo
    FROM SIYM.DDJJ_DECLARACIONES
    WHERE siym.ddjj_declaraciones.idoperador = p_idoperador
    AND SIYM.DDJJ_DECLARACIONES.PERIODO      BETWEEN P_PERIODO_INI AND P_PERIODO_FIN
    --AND SIYM.DDJJ_DECLARACIONES.PERIODO      = TO_DATE('01/03/2010','DD/MM/RRRR')

    --AND SIYM.DDJJ_DECLARACIONES.PERIODO      BETWEEN TO_DATE('01/06/2016','DD/MM/RRRR') AND TO_DATE('01/12/2016','DD/MM/RRRR')

    ORDER BY SIYM.DDJJ_DECLARACIONES.PERIODO,
      siym.ddjj_declaraciones.motivo;
  v_encabezado  VARCHAR2(750);
  v_sql_ing     VARCHAR2(750);
  v_sql_sal     VARCHAR2(750);
  v_sql_sto     VARCHAR2(750);
  v_sql_sto_ter VARCHAR2(750);
  v_sql_bal     VARCHAR2(1500);
  v_sql_hr      VARCHAR2(750);
  v_sql_aju     VARCHAR2(750);
  v_into_ctrl   NUMBER(7);
  v_nom_archivo VARCHAR2(24);
  v_fileHandler UTL_FILE.FILE_TYPE;
  excelReport ExcelDocumentType                       := ExcelDocumentType();
  documentArray ExcelDocumentLine                     := ExcelDocumentLine();
  v_worksheet_rec ExcelDocTypeUtils.T_WORKSHEET_DATA  := NULL;
  v_worksheet_array ExcelDocTypeUtils.WORKSHEET_TABLE := ExcelDocTypeUtils.WORKSHEET_TABLE();
  v_style_array ExcelDocTypeUtils.STYLE_LIST          := ExcelDocTypeUtils.STYLE_LIST();
BEGIN
  v_into_ctrl := 0;
  FOR v_ctrl  IN c_ctrl
  LOOP
    -- ENCABEZADO
    v_encabezado:='SELECT DDJJ_DECLARACIONES.IDOPERADOR, TO_CHAR(DDJJ_DECLARACIONES.PERIODO, ''YYYY-MM-DD'') || ''T00:00:00'', DDJJ_DECLARACIONES.MOTIVO FROM DDJJ_DECLARACIONES WHERE DDJJ_DECLARACIONES.IDOPERADOR = '|| v_ctrl.idoperador ||' AND DDJJ_DECLARACIONES.PERIODO = TO_DATE('''|| v_ctrl.periodo ||''',''DD/MM/RRRR'') AND DDJJ_DECLARACIONES.MOTIVO       = '||v_ctrl.motivo ;

