    SELECT COUNT(SIYM.DDJJ_INGRESOS.IDORIGEN)
    INTO v_into_ctrl
    FROM SIYM.DDJJ_INGRESOS
    WHERE SIYM.DDJJ_INGRESOS.IDORIGEN IS NOT NULL
    AND SIYM.DDJJ_INGRESOS.IDOPERADOR  = v_ctrl.idoperador
    AND siym.ddjj_ingresos.periodo     = v_ctrl.periodo
