END;

CREATE OR REPLACE PROCEDURE PRD_MULTAS_PAGOS(
    p_fecha_pago DATE,
    p_boletanro INTEGER,
    p_importe FLOAT,
    p_idforma_pago INTEGER,
    p_retorno OUT VARCHAR)
AS
  v_total FLOAT;
  v_idboleta INTEGER;
  v_idnota VARCHAR2(11);
  v_fecha_emision DATE;

BEGIN
    BEGIN
      select inym_boletas.idboleta, inym_detalle_boletas.importe, inym_boletas.idnota_ddjj, inym_boletas.fecha_emision
        into v_idboleta, v_total, v_idnota, v_fecha_emision 
      from inym_boletas inner join inym_detalle_boletas on inym_detalle_boletas.idboleta = inym_boletas.idboleta
      where boleta_nro = p_boletanro and inym_boletas.idtipoboleta = 1 and inym_detalle_boletas.fecha_pago is null;
      --dbms_output.put_line('IDBOLETA:'||idboleta);
      IF v_total <> p_importe THEN
        p_retorno:='El importe pagado no corresponde a la boleta.';
      ELSE
        IF  to_date(p_fecha_pago,'dd/mm/rrrr') < to_date(v_fecha_emision,'dd/mm/rrrr') THEN
            p_retorno:='La fecha de pago es menor que la fecha de emision de la boleta.';
        ELSE        
            UPDATE inym_detalle_boletas SET inym_detalle_boletas.idforma_pago =p_idforma_pago, inym_detalle_boletas.fecha_pago = p_fecha_pago, 
                                            inym_detalle_boletas.idusuario_carga_pago = sys_context('USERENV','SESSION_USERID'),
                                            inym_detalle_boletas.fecha_carga_pago = sysdate
            WHERE inym_detalle_boletas.idboleta = v_idboleta AND inym_detalle_boletas.boleta_nro=p_boletanro;

            --dbms_output.put_line('Actualizados:'||SQL%ROWCOUNT);

            IF SQL%FOUND THEN
              IF v_idnota IS NOT NULL THEN
                UPDATE exp_nota_fuera SET exp_nota_fuera.boleta = p_boletanro, exp_nota_fuera.fecha_pago = p_fecha_pago
                WHERE idnota_fuera = v_idnota;

                IF SQL%FOUND THEN
                  p_retorno:='Pago Cargado.';
                  PRD_CONVENIOS_ACT_ESTADO();
                ELSE
                  p_retorno:='ERROR: No se pudo cargar la habilitacion.';
                END IF;
              ELSE
                p_retorno:='Pago Cargado.';
                PRD_CONVENIOS_ACT_ESTADO();
                PRD_ACT_BOL_CONV_2109(v_idboleta, p_boletanro, p_fecha_pago);
              END IF;            
            ELSE
              p_retorno:='ERROR: No se pudo cargar el pago.';
            END IF;
        END IF;
      END IF;            
    EXCEPTION
      WHEN NO_DATA_FOUND THEN
        p_retorno:='No se pudo cargar el pago gral.';
    END;

END;

CREATE OR REPLACE PROCEDURE "PRD_PACKING" ( p_retorno OUT VARCHAR ) AS v_nro_entrega INTEGER; CURSOR c_entregas IS SELECT DISTINCT "TMP_PACKING"."IDENTREGA", est_pedidos.idpedido FROM "TMP_PACKING" INNER JOIN est_pedidos on est_pedidos.idserie = "TMP_PACKING".IDSERIE and est_pedidos.nro_pedido = "TMP_PACKING"."NRO_PEDIDO" AND est_pedidos.idestado in (2,4,5) WHERE ( TMP_PACKING.IDBANCO, TMP_PACKING.IDSUCURSAL, TMP_PACKING.IDCODIGO, TMP_PACKING.CAJA, TMP_PACKING.PACK, TMP_PACKING.BOBINA, TMP_PACKING.IDSERIE ) NOT IN (SELECT IDBANCO, IDSUCURSAL, IDCODIGO, CAJA, PACK, BOBINA, IDSERIE FROM SIYM.EST_PACKING ); BEGIN p_retorno := '['; FOR fila IN C_entregas LOOP SELECT siym.est_entregas_seq.nextval INTO v_nro_entrega FROM DUAL; INSERT INTO SIYM.est_entregas VALUES ( v_nro_entrega, ( SELECT idproveedor FROM SIYM.est_proveedores WHERE activo=1 ) , fila.identrega, sysdate, fila.idpedido ); INSERT INTO siym.est_packing (SELECT idsucursal, idbanco, idcodigo, caja, pack, BOBINA, idserie, v_nro_entrega, linicial, ninicial, lfinal, nfinal, NULL, NULL FROM SIYM.tmp_packing WHERE identrega=fila.identrega );
update SIYM.est_pedidos set idestado = 2 where idpedido =fila.idpedido and idestado =1;
update SIYM.est_pedidos set idestado =3 where idpedido = fila.idpedido and not exists ( select * from SIYM.est$_pedidos_dif where idpedido=fila.idpedido and dif > 0);
IF LENGTH(p_retorno) > 1 THEN p_retorno:=p_retorno || ',' || TO_CHAR(v_nro_entrega); ELSE p_retorno:=p_retorno || TO_CHAR(v_nro_entrega); END IF;
END LOOP; p_retorno:=p_retorno || ']'; END ;

CREATE OR REPLACE PROCEDURE PRD_PKG_VERIF_SOLAPADOS AS 
BEGIN

      DECLARE
      numfila NUMBER;
      orden VARCHAR2(6);
      fecha_bco VARCHAR2(12);
      CURSOR v_obj_pkg
      IS
        SELECT DISTINCT *
        FROM TMP_PACKING
        ORDER BY IDENTREGA, BOBINA;

      CURSOR pkg_cv (l_serie VARCHAR2, l_linicial VARCHAR2, l_lfinal VARCHAR2, l_nfinal NUMBER, l_ninicial NUMBER, l_entrega VARCHAR2, l_codigo VARCHAR2)
      IS
        SELECT *
        FROM EST_PACKING
        WHERE IDSERIE = l_serie
        AND substr(trim(to_char(IDCODIGO)),1,1) = substr(trim(to_char(l_codigo)),1,1)
        AND (
          --PRIMER CASO igual <-> igual
          (
           (SUBSTR(l_linicial,1,1)= SUBSTR(l_lfinal,1,1)  AND SUBSTR(linicial,1,1)=SUBSTR(lfinal,1,1) )  AND
           ( 
           (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000'))<=TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
            AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000'))>=TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
            )
            OR
           (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000'))<=TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
            AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000'))>=TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
            )
            OR
           (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000'))>=TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
            AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000'))<=TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
            )
            OR
           (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000'))<=TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
            AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000'))>=TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
            )
            )
          )
        OR
        (
         --SEGUNDO CASO IGUAL_AA <-> DIF
         (SUBSTR(l_linicial,1,1)=SUBSTR(l_lfinal,1,1) AND SUBSTR(l_linicial,2,3)='AA' AND SUBSTR(linicial,1,1)<>SUBSTR(lfinal,1,1)) AND
         ( 
          (chr(ascii(SUBSTR(linicial,1,1))+3) || SUBSTR(linicial,2,3) ||TRIM(TO_CHAR(ninicial,'00000')) <= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal) ||TRIM(TO_CHAR(nfinal,'00000')) >= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
          )
          OR
          (chr(ascii(SUBSTR(linicial,1,1))+3) || SUBSTR(linicial,2,3) ||TRIM(TO_CHAR(ninicial,'00000')) <= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) >= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
          OR
          (chr(ascii(SUBSTR(linicial,1,1))+3) || SUBSTR(linicial,2,3) ||TRIM(TO_CHAR(ninicial,'00000')) >= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) <= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
          OR
          (chr(ascii(SUBSTR(linicial,1,1))+3) || SUBSTR(linicial,2,3) ||TRIM(TO_CHAR(ninicial,'00000')) <= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) >= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
         )
        )
        OR
        (
         --TERCER CASO IGUAL_ZZ <-> DIF
         (SUBSTR(l_linicial,1,1)=SUBSTR(l_lfinal,1,1) AND SUBSTR(l_linicial,2,3)='ZZ' AND SUBSTR(linicial,1,1)<>SUBSTR(lfinal,1,1)) AND
         ( 
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) <= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND chr( ascii(SUBSTR(lfinal,1,1))-3) || SUBSTR(lfinal,2,3) ||TRIM(TO_CHAR(nfinal,'00000')) >= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
          )
          OR
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) <= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
           AND chr( ascii(SUBSTR(lfinal,1,1))-3) || SUBSTR(lfinal,2,3) ||TRIM(TO_CHAR(nfinal,'00000')) >= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
          OR
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) >= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND chr( ascii(SUBSTR(lfinal,1,1))-3) || SUBSTR(lfinal,2,3) ||TRIM(TO_CHAR(nfinal,'00000')) <= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
          OR
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) <= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND chr( ascii(SUBSTR(lfinal,1,1))-3) || SUBSTR(lfinal,2,3) ||TRIM(TO_CHAR(nfinal,'00000')) >= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
         )
        )

        OR
        (
         --CUARTO CASO DIF <-> IGUAL_AA
         (SUBSTR(l_linicial,1,1)<>SUBSTR(l_lfinal,1,1) AND SUBSTR(linicial,1,1)=SUBSTR(lfinal,1,1) AND SUBSTR(linicial,2,3)='AA') AND
         ( 
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) <= chr( ascii(SUBSTR(l_linicial,1,1))+3) || SUBSTR(l_linicial,2,3) ||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) >= chr( ascii(SUBSTR(l_linicial,1,1))+3) || SUBSTR(l_linicial,2,3) ||TRIM(TO_CHAR(l_ninicial,'00000'))
          )
          OR
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) <= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) >= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
          OR
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) >= chr( ascii(SUBSTR(l_linicial,1,1))+3) || SUBSTR(l_linicial,2,3) ||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) <= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
          OR
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) <= chr( ascii(SUBSTR(l_linicial,1,1))+3) || SUBSTR(l_linicial,2,3) ||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) >= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
         )
        )
        OR
        (
         --QUINTO CASO DIF <-> IGUAL_ZZ
         (SUBSTR(l_linicial,1,1)<>SUBSTR(l_lfinal,1,1) AND SUBSTR(linicial,1,1)=SUBSTR(lfinal,1,1) AND SUBSTR(linicial,2,3)='ZZ') AND
         ( 
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) <= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) >= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
          )
          OR
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) <= chr( ascii(SUBSTR(l_lfinal,1,1))-3) || SUBSTR(l_lfinal,2,3) ||TRIM(TO_CHAR(l_nfinal,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) >= chr( ascii(SUBSTR(l_lfinal,1,1))-3) || SUBSTR(l_lfinal,2,3) ||TRIM(TO_CHAR(l_nfinal,'00000'))
          )
          OR
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) >= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) <= chr( ascii(SUBSTR(l_lfinal,1,1))-3) || SUBSTR(l_lfinal,2,3) ||TRIM(TO_CHAR(l_nfinal,'00000'))
          )
          OR
          (TRIM(linicial)||TRIM(TO_CHAR(ninicial,'00000')) <= TRIM(l_linicial)||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) >= chr( ascii(SUBSTR(l_lfinal,1,1))-3) || SUBSTR(l_lfinal,2,3) ||TRIM(TO_CHAR(l_nfinal,'00000'))
          )
         )
        )
        OR
        (
         --SEXTO CASO DIF <-> DIF
         (SUBSTR(l_linicial,1,1)<>SUBSTR(l_lfinal,1,1) AND SUBSTR(linicial,1,1)<>SUBSTR(lfinal,1,1)) AND
         ( 
          (chr(ascii(SUBSTR(linicial,1,1))+3) || SUBSTR(linicial,2,3) ||TRIM(TO_CHAR(ninicial,'00000')) <= chr( ascii(SUBSTR(l_linicial,1,1))+3) || SUBSTR(l_linicial,2,3) ||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) >= chr( ascii(SUBSTR(l_linicial,1,1))+3) || SUBSTR(l_linicial,2,3) ||TRIM(TO_CHAR(l_ninicial,'00000'))
          )
          OR
          (chr(ascii(SUBSTR(linicial,1,1))+3) || SUBSTR(linicial,2,3) ||TRIM(TO_CHAR(ninicial,'00000')) <= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) >= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
          OR
          (chr(ascii(SUBSTR(linicial,1,1))+3) || SUBSTR(linicial,2,3) ||TRIM(TO_CHAR(ninicial,'00000')) >= chr( ascii(SUBSTR(l_linicial,1,1))+3) || SUBSTR(l_linicial,2,3) ||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) <= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
          OR
          (chr(ascii(SUBSTR(linicial,1,1))+3) || SUBSTR(linicial,2,3) ||TRIM(TO_CHAR(ninicial,'00000')) <= chr( ascii(SUBSTR(l_linicial,1,1))+3) || SUBSTR(l_linicial,2,3) ||TRIM(TO_CHAR(l_ninicial,'00000'))
           AND TRIM(lfinal)||TRIM(TO_CHAR(nfinal,'00000')) >= TRIM(l_lfinal)||TRIM(TO_CHAR(l_nfinal, '00000'))
          )
         )
        )
      );
        pkg_rec pkg_cv%ROWTYPE;
    BEGIN
      numfila:=0;
      DELETE FROM TMP_PACKING_SOLAPADO;
      FOR pkg1_rec IN v_obj_pkg
      LOOP
        numfila:=numfila+1;
        open pkg_cv (pkg1_rec.idserie, pkg1_rec.linicial, pkg1_rec.lfinal, pkg1_rec.nfinal, pkg1_rec.ninicial, pkg1_rec.identrega, pkg1_rec.idcodigo);
        LOOP
          FETCH pkg_cv INTO pkg_rec;
          EXIT WHEN pkg_cv%NOTFOUND;

          INSERT INTO TMP_PACKING_SOLAPADO VALUES (pkg1_rec.IDBANCO, pkg1_rec.IDSUCURSAL, pkg1_rec.IDCODIGO, pkg1_rec.CAJA, pkg1_rec.PACK, pkg1_rec.BOBINA, pkg1_rec.IDSERIE, pkg1_rec.IDENTREGA, pkg1_rec.LINICIAL ,pkg1_rec.NINICIAL, pkg1_rec.LFINAL, pkg1_rec.NFINAL, pkg1_rec.ORDEN, pkg1_rec.FECHA_BCO, 'O', numfila);
          INSERT INTO TMP_PACKING_SOLAPADO VALUES (pkg_rec.IDBANCO, pkg_rec.IDSUCURSAL, pkg_rec.IDCODIGO, pkg_rec.CAJA, pkg_rec.PACK, pkg_rec.BOBINA, pkg_rec.IDSERIE, pkg_rec.IDENTREGA, pkg_rec.LINICIAL ,pkg_rec.NINICIAL, pkg_rec.LFINAL, pkg_rec.NFINAL, pkg_rec.ORDEN, pkg_rec.FECHA_BCO, 'D', numfila);
          COMMIT;
        END LOOP;
        CLOSE pkg_cv;
      END LOOP;
    END;
END PRD_PKG_VERIF_SOLAPADOS;

CREATE OR REPLACE PROCEDURE PRD_TMP_MIGRA_PACKING_PEDIDOS ( P_RETORNO OUT VARCHAR ) AS
CURSOR CUR_EST_PACKING IS SELECT 0 AS IDPEDIDO, 0 AS NRO_PEDIDO, TO_DATE('29/12/2020') AS PERIODO, TO_DATE('29/12/2020') AS FECHA_CREACION, TO_DATE('29/12/2020') AS FECHA_CALCULO, 185 AS IDUSUARIO, 3 AS IDESTADO_PEDIDO, TO_DATE('29/12/2020') AS FECHA_ENVIO, 185 AS IDUSUARIO_ENVIA, COUNT (PACK) AS CANT_PED, TO_DATE('29/12/2020') AS FECHA_RECEPCION, 185 AS IDUSUARIO_RECIBE, 2 AS IDESTADO_ENTREGA, 11 AS IDSUCURSAL, 3 AS IDBANCO, PKN_PED.IDENTREGA, PKN_PED.IDCODIGO, PKN_PED.IDSERIE, PKN_PED.CAJA FROM SIYM.TMP$_MIGRA_PACKING_PEDIDOS PKN_PED group by IDENTREGA, IDCODIGO, IDSERIE, CAJA ORDER BY PKN_PED.IDENTREGA, PKN_PED.IDSERIE, PKN_PED.IDCODIGO, PKN_PED.CAJA ;
BEGIN
FOR FILA_PACKING IN CUR_EST_PACKING LOOP INSERT INTO SIYM.EST_ENTREGAS_DETALLES ( IDENTREGA_DETALLE, IDENTREGA, FECHA_RECEPCION, IDUSUARIO_RECIBE, IDESTADO, IDCODIGO, IDSERIE, CAJA ) VALUES ( EST_ENTREGAS_DETALLES_SEQ.NEXTVAL, FILA_PACKING.IDENTREGA, FILA_PACKING.FECHA_RECEPCION, FILA_PACKING.IDUSUARIO_RECIBE, FILA_PACKING.IDESTADO_ENTREGA, FILA_PACKING.IDCODIGO, FILA_PACKING.IDSERIE, FILA_PACKING.CAJA );
END LOOP;
P_RETORNO:='insercion correcta';
EXCEPTION WHEN OTHERS THEN ROLLBACK; DBMS_OUTPUT.PUT_LINE ('ERROR AL INSERTAR EST_ENTREGAS_DETALLES '|| SQLERRM ); P_RETORNO:='Error al insertar '; END;

CREATE OR REPLACE PROCEDURE "PRD_TRASLADO_PKG"( p_ntraslado SIYM.est_traslados.idtraslado%TYPE, p_fechatras VARCHAR2, p_desbanco SIYM.est_traslados.idbanco%TYPE, p_dessucursal SIYM.est_traslados.idsucursal%TYPE, p_codigo SIYM.est_traslados.idcodigo%TYPE, p_inicaja SIYM.est_traslados.caja%TYPE, p_fincaja SIYM.est_traslados.caja%TYPE, p_serie SIYM.est_traslados.idserie%TYPE, p_orgbanco SIYM.est_traslados.idbanco_org%TYPE, p_orgsucursal SIYM.est_traslados.idsucursal_org%TYPE ) AS v_fechatras VARCHAR2(10); BEGIN v_fechatras := p_fechatras; -- ACTUALIZA PACKING DE SEGURIDAD AL CORRESPONDIENTE SUCURSAL BANCARIA UPDATE SIYM.EST_PACKING SET SIYM.EST_PACKING.IDSUCURSAL = p_dessucursal, SIYM.EST_PACKING.IDBANCO = p_desbanco WHERE SIYM.EST_PACKING.IDBANCO = p_orgbanco AND SIYM.EST_PACKING.IDSUCURSAL = p_orgsucursal AND SIYM.EST_PACKING.IDCODIGO = p_codigo AND SIYM.EST_PACKING.CAJA BETWEEN p_inicaja AND p_fincaja AND SIYM.EST_PACKING.IDSERIE = p_serie ;
-- INSERTA EN LA TABLA TRASLADO INSERT INTO SIYM.EST_TRASLADOS ( IDTRASLADO, FECHA, IDBANCO, IDSUCURSAL, IDCODIGO, CAJA, PACK, BOBINA, IDSERIE, IDENTREGA, IDBANCO_ORG, IDSUCURSAL_ORG ) SELECT p_ntraslado, TO_DATE(v_fechatras, 'DD/MM/RRRR') , SIYM.EST_PACKING.IDBANCO, SIYM.EST_PACKING.IDSUCURSAL, SIYM.EST_PACKING.IDCODIGO, SIYM.EST_PACKING.CAJA, SIYM.EST_PACKING.PACK, SIYM.EST_PACKING.BOBINA, SIYM.EST_PACKING.IDSERIE, SIYM.EST_PACKING.IDENTREGA, p_orgbanco, p_orgsucursal FROM SIYM.EST_PACKING WHERE SIYM.EST_PACKING.IDBANCO = p_desbanco AND SIYM.EST_PACKING.IDSUCURSAL = p_dessucursal AND SIYM.EST_PACKING.IDCODIGO = p_codigo AND SIYM.EST_PACKING.IDSERIE = p_serie AND SIYM.EST_PACKING.CAJA BETWEEN p_inicaja AND p_fincaja;
END;

CREATE OR REPLACE PROCEDURE PRD_VTO_EMAIL
AS
  v_from      varchar2(80) := 'no_responder@inym.local';
  v_recipient VARCHAR2(80) := 'rmander@inym.local';
  v_subject   VARCHAR2(80) := 'Control de Vencimientos';
  v_Mail_Host VARCHAR2(30) := 'mail.inym.local';
  v_Mail_Conn utl_smtp.Connection;
  crlf VARCHAR2(2) := chr(13)||chr(10);
  tab  VARCHAR2(1) := chr(9);
  v_msg CLOB       := '';

  CURSOR c_plantas
  IS
    SELECT siym.reg_operadores.idoperador,
      siym.reg_empresas.nom_deno,
      SIYM.REG_PLANTAS_OPERADORES.IDPLANTA,
      siym.reg_plantas_operadores.alta,
      siym.reg_plantas_operadores.vencimiento
    FROM siym.reg_empresas
    INNER JOIN siym.reg_operadores
    ON siym.reg_empresas.idempresa = siym.reg_operadores.idempresa
    INNER JOIN siym.reg_plantas_operadores
    ON siym.reg_operadores.idoperador              = siym.reg_plantas_operadores.idoperador
    WHERE SIYM.REG_PLANTAS_OPERADORES.VENCIMIENTO >= to_date('01/'
      ||TO_CHAR(sysdate, 'MM/RRRR'), 'DD/MM/RRRR')
    AND SIYM.REG_PLANTAS_OPERADORES.VENCIMIENTO <= last_day(add_months(SysDate, '2'))
    ORDER BY reg_operadores.idoperador,
      reg_plantas_operadores.vencimiento;

  CURSOR c_depositos
  IS
    SELECT siym.reg_operadores.idoperador,
      siym.reg_empresas.nom_deno,
      siym.reg_depositos_operadores.iddeposito,
      siym.reg_depositos_operadores.alta,
      siym.reg_depositos_operadores.vencimiento
    FROM siym.reg_empresas
    INNER JOIN siym.reg_operadores
    ON siym.reg_empresas.idempresa = siym.reg_operadores.idempresa
    INNER JOIN siym.reg_depositos_operadores
    ON siym.reg_operadores.idoperador                = siym.reg_depositos_operadores.idoperador
    WHERE siym.reg_depositos_operadores.vencimiento >= to_date('01/'
      ||TO_CHAR(sysdate, 'MM/RRRR'), 'DD/MM/RRRR')
    AND SIYM.REG_DEPOSITOS_OPERADORES.VENCIMIENTO <= last_day(add_months(SysDate, '2'))
    ORDER BY siym.reg_operadores.idoperador,
      SIYM.REG_DEPOSITOS_OPERADORES.VENCIMIENTO;

  CURSOR c_rne
  IS
    SELECT siym.reg_operadores.idoperador,
      siym.reg_empresas.nom_deno,
      siym.reg_plantas.idplanta,
      DECODE(siym.reg_plantas.rne, NULL, 'Sin Dato', siym.reg_plantas.rne) rne,
      DECODE(siym.reg_plantas.fecha_rne, NULL, 'Sin Dato', siym.reg_plantas.fecha_rne) fecha_rne,
      DECODE(siym.reg_plantas.vencimiento_rne, NULL, 'Sin Dato', siym.reg_plantas.vencimiento_rne) vencimiento_rne
    FROM siym.reg_plantas
    INNER JOIN siym.reg_plantas_operadores
    ON siym.reg_plantas.idplanta = siym.reg_plantas_operadores.idplanta
    INNER JOIN siym.reg_operadores
    ON siym.reg_operadores.idoperador = siym.reg_plantas_operadores.idoperador
    INNER JOIN siym.reg_empresas
    ON siym.reg_empresas.idempresa           = siym.reg_operadores.idempresa
    WHERE (siym.reg_plantas.rne             IS NULL
    AND siym.reg_operadores.idtipo_operador <> 5)
    OR (siym.reg_plantas.vencimiento_rne    >= to_date('01/'
      ||TO_CHAR(sysdate, 'MM/RRRR'), 'DD/MM/RRRR')
    AND siym.reg_plantas.vencimiento_rne <= last_day(add_months(SysDate, '2')))
    ORDER BY siym.reg_plantas.vencimiento_rne,
      SIYM.REG_OPERADORES.IDOPERADOR;

  CURSOR c_rnpa
  IS
    SELECT siym.reg_operadores.IDOPERADOR,
      siym.reg_empresas.NOM_DENO,
      siym.reg_productos.IDPRODUCTO,
      siym.reg_uso_productos.INICIO,
      siym.reg_uso_productos.FIN
    FROM siym.reg_productos
    INNER JOIN siym.reg_uso_productos
    ON siym.reg_productos.IDPRODUCTO = siym.reg_uso_productos.IDPRODUCTO
    INNER JOIN siym.reg_operadores
    ON siym.reg_operadores.IDOPERADOR = siym.reg_uso_productos.IDOPERADOR
    INNER JOIN siym.reg_empresas
    ON siym.reg_empresas.IDEMPRESA    = siym.reg_operadores.IDEMPRESA
    WHERE siym.reg_uso_productos.FIN >= to_date('01/'
      || TO_CHAR(SysDate, 'MM/RRRR'), 'DD/MM/RRRR')
    AND siym.reg_uso_productos.FIN  <= last_day(add_months(SysDate, '2'))
    AND siym.reg_uso_productos.BAJA IS NULL
    order by siym.reg_uso_productos.fin,
      siym.reg_operadores.IDOPERADOR;
  BEGIN
    v_msg := v_msg || '<table><tr><th colspan="5">Vencimientos de Plantas</th></tr>';
    v_msg := v_msg || '<tr><th>N'||CHR(38)||'deg; Operador</th><th>Nombre/Denominaci'||CHR(38)||'oacute;n</th><th>N'||CHR(38)||'deg; Planta</th><th>Alta</th><th>Ventimiento</th></tr>';
    FOR reg IN c_plantas
    LOOP
      v_msg := v_msg || '<tr><td>' || reg.idoperador || '</td><td>' || reg.nom_deno || '</td><td>' || reg.idplanta || '</td><td>' || reg.alta || '</td><td>' || reg.vencimiento || '</td></tr>';
    END LOOP;
    v_msg := v_msg || '</table>';

    v_msg := v_msg || '<table><tr><th colspan="5">Vencimientos de Dep'||CHR(38)||'oacute;sitos</th></tr>';
    v_msg := v_msg || '<tr><th>N'||CHR(38)||'deg; Operador</th><th>Nombre/Denominaci'||CHR(38)||'oacute;n</th><th>N'||CHR(38)||'deg; Dep'||CHR(38)||'oacute;sito</th><th>Alta</th><th>Ventimiento</th></tr>';
    FOR reg IN c_depositos
    LOOP
      v_msg := v_msg || '<tr><td>' || reg.idoperador || '</td><td>' || reg.nom_deno || '</td><td>' || reg.iddeposito || '</td><td>' || reg.alta || '</td><td>' || reg.vencimiento || '</td></tr>';
    END LOOP;
    v_msg := v_msg || '</table>';

    v_msg := v_msg || '<table><tr><th colspan="6">Vencimientos de RNE</th></tr>';
    v_msg := v_msg || '<tr><th>N'||CHR(38)||'deg; Operador</th><th>Nombre/Denominaci'||CHR(38)||'oacute;n</th><th>N'||CHR(38)||'deg; Planta</th><th>R.N.E.</th><th>Inicio</th><th>Ventimiento</th></tr>';
    FOR reg IN c_rne
    LOOP
      v_msg := v_msg || '<tr><td>' || reg.idoperador || '</td><td>' || reg.nom_deno || '</td><td>' || reg.idplanta || '</td><td>' || reg.rne || '</td><td>' || reg.fecha_rne || '</td><td>' || reg.vencimiento_rne || '</td></tr>';
    END LOOP;
    v_msg := v_msg || '</table>';

    v_msg := v_msg || '<table><tr><th colspan="5">Vencimientos de RNPA</th></tr>';
    v_msg := v_msg || '<tr><th>N'||CHR(38)||'deg; Operador</th><th>Nombre/Denominaci'||CHR(38)||'oacute;n</th><th>R.N.P.A.</th><th>Inicio</th><th>Ventimiento</th></tr>';
    FOR reg IN c_rnpa
    LOOP
      v_msg := v_msg || '<tr><td>' || reg.idoperador || '</td><td>' || reg.nom_deno || '</td><td>' || reg.idproducto || '</td><td>' || reg.inicio || '</td><td>' || reg.fin || '</td></tr>';
    END LOOP;
    v_msg       := v_msg || '</table>';

    v_Mail_Conn := utl_smtp.open_connection(v_Mail_Host, 25);
    utl_smtp.helo(v_mail_conn, v_mail_host);
    utl_smtp.mail(v_mail_conn, v_from);
    utl_smtp.Rcpt(v_Mail_Conn, v_Recipient);
    utl_smtp.Data(v_Mail_Conn, 'Date: ' || TO_CHAR(sysdate, 'Dy, DD Mon YYYY hh24:mi:ss') || crlf || 'From: ' || v_From || crlf || 'Subject: '|| v_Subject || crlf || 'To: ' || v_recipient || crlf || 'Content-Type: text/html; charset=us-ascii' || crlf || crlf || v_msg );
    utl_smtp.Quit(v_mail_conn);
  EXCEPTION
  WHEN utl_smtp.Transient_Error OR utl_smtp.Permanent_Error THEN
    raise_application_error(-20000, 'Unable to send mail: '||sqlerrm);
  END PRD_VTO_EMAIL;

CREATE OR REPLACE PROCEDURE      migra_lotes
AS
   CURSOR c_lotes
   IS
      SELECT *
        FROM siym.reg_mig_lotes;

   --WHERE ROWNUM <= 100;
   idoperador   VARCHAR2 (20);
   msj_error    VARCHAR2 (200);
   ejecutar     BOOLEAN;
   error_msg    VARCHAR2 (1024);
BEGIN
   EXECUTE IMMEDIATE 'DELETE siym.reg_lotes_operadores_hist';

   EXECUTE IMMEDIATE 'DELETE siym.reg_lotes_operadores';

   EXECUTE IMMEDIATE 'DELETE siym.reg_lotes_no_operadores';

   EXECUTE IMMEDIATE 'DELETE siym.reg_lotes';

   EXECUTE IMMEDIATE 'DELETE siym.reg_nomig_lotes';

   EXECUTE IMMEDIATE 'DROP SEQUENCE siym.reg_lotes_seq';

   EXECUTE IMMEDIATE 'create sequence siym.reg_lotes_seq
minvalue 1
maxvalue 999999999999999999999
start with 1
increment by 1
cache 20';

   COMMIT;
   DBMS_OUTPUT.put_line
      ('*********************** SE LIMPIAN LAS TABLAS REG_LOTES_OPERADORES_HIST, REG_LOTES_OPERADORES Y REG_LOTES ***********************'
      );

   FOR lote_migra IN c_lotes
   LOOP
      error_msg := '';

      /*IF (TRIM (lote_migra.cuit) <> 1)
      THEN*/
         BEGIN
            /*DBMS_OUTPUT.put_line ('CATASTRAL: ' || lote_migra.dir_catastral);
            DBMS_OUTPUT.put_line ('NRO LOTE: ' || lote_migra.nro_lote);
            DBMS_OUTPUT.put_line ('ID MUNICIPIO: ' || lote_migra.municipio);
            DBMS_OUTPUT.put_line ('DOMICILIO ' || lote_migra.domicilio);
            DBMS_OUTPUT.put_line ('SUP TOTAL: ' || lote_migra.sup_total);
            DBMS_OUTPUT.put_line ('SUP CULT: ' || lote_migra.sup_cultivada);
            DBMS_OUTPUT.put_line ('FEC ALTA: ' || lote_migra.fecha_alta);
            DBMS_OUTPUT.put_line ('AO IMP: '
                                  || lote_migra.anio_implementacion
                                 );
            DBMS_OUTPUT.put_line ('OBS: '
                                  || lote_migra.observaciones
                                 );*/
            ejecutar := TRUE;

            INSERT INTO siym.reg_lotes
                 VALUES (siym.reg_lotes_seq.NEXTVAL,
                         TRIM (REPLACE (lote_migra.dir_catastral, ' ', '')),
                         lote_migra.nro_lote,
                         TO_NUMBER (lote_migra.municipio),
                         lote_migra.domicilio,
                         REPLACE (NVL (lote_migra.sup_total, 0), '.', ','),
                         REPLACE (NVL (lote_migra.sup_cultivada, 0), '.',
                                  ','),
                         NVL2 (lote_migra.fecha_alta,
                               TO_DATE (lote_migra.fecha_alta, 'yyyy/mm/dd'),
                               ''
                              ),
                         NULL,
                         NVL2 (lote_migra.anio_implementacion,
                               TO_DATE (lote_migra.anio_implementacion,
                                        'yyyy/mm/dd'
                                       ),
                               ''
                              ),
                         lote_migra.observaciones);

            DBMS_OUTPUT.put_line
                              (   'SE INSERTO EN REG_LOTES ** dir catastral: '
                               || lote_migra.dir_catastral
                               || ' ** nro lote: '
                               || lote_migra.nro_lote
                              );
         EXCEPTION
            WHEN OTHERS
            THEN
               ejecutar := FALSE;
               DBMS_OUTPUT.put_line (   'NO SE INSERTO EN REG_LOTES ** '
                                     || SQLCODE
                                     || ' ** '
                                     || SQLERRM
                                    );
               error_msg := 'NO SE INSERTO EN REG_LOTES ** ' || SQLERRM;

               BEGIN
                  INSERT INTO siym.reg_nomig_lotes
                       VALUES (lote_migra.cuit, lote_migra.domicilio,
                               lote_migra.provincia, lote_migra.depto,
                               lote_migra.municipio, lote_migra.seccion,
                               lote_migra.dir_catastral, lote_migra.nro_lote,
                               lote_migra.sup_total,
                               lote_migra.sup_cultivada,
                               lote_migra.anio_implementacion,
                               lote_migra.fecha_alta,
                               lote_migra.observaciones, error_msg);

                  DBMS_OUTPUT.put_line
                     (   'SE INSERTO EL REGISTRO EN REG_NOMIG_LOTES -> CATASTRAL: '
                      || lote_migra.dir_catastral
                      || ' -> NRO LOTE: '
                      || lote_migra.nro_lote
                     );
               EXCEPTION
                  WHEN OTHERS
                  THEN
                     DBMS_OUTPUT.put_line
                        (   'NO SE INSERTO EL REGISTRO EN REG_NOMIG_LOTES -> CATASTRAL: '
                         || lote_migra.dir_catastral
                         || ' -> NRO LOTE: '
                         || lote_migra.nro_lote
                        );
               END;
         END;

         IF (ejecutar = TRUE)
         THEN
            BEGIN
               ejecutar := TRUE;

               SELECT idoperador
                 INTO idoperador
                 --FROM siym.reg_operadores
               FROM   siym.reg$_operadores2
                WHERE idtipo_operador = 1
                  AND TRIM (idempresa) = TRIM (lote_migra.cuit)
                  AND TRIM (lote_migra.cuit) <> '1';
            EXCEPTION
               WHEN NO_DATA_FOUND
               THEN
                  ejecutar := FALSE;
                  error_msg :=
                        'NO SE ENCONTRO EL OPERADOR CON CUIT: '
                     || lote_migra.cuit;
                  DBMS_OUTPUT.put_line (error_msg);
               WHEN TOO_MANY_ROWS
               THEN
                  BEGIN
                     ejecutar := TRUE;

                     SELECT idoperador
                       INTO idoperador
                       --FROM siym.reg_operadores
                     FROM   siym.reg$_operadores2
                      WHERE idtipo_operador = 1
                        AND baja IS NULL
                        AND TRIM (idempresa) = TRIM (lote_migra.cuit)
                        AND TRIM (lote_migra.cuit) <> '1'
                        AND ROWNUM = 1;
                  EXCEPTION
                     WHEN NO_DATA_FOUND
                     THEN
                        BEGIN
                           ejecutar := TRUE;

                           SELECT idoperador
                             INTO idoperador
                             --FROM siym.reg_operadores
                           FROM   siym.reg$_operadores2
                            WHERE idtipo_operador = 1
                              AND TRIM (idempresa) = TRIM (lote_migra.cuit)
                              AND TRIM (lote_migra.cuit) <> '1'
                              AND ROWNUM = 1;
                        EXCEPTION
                           WHEN NO_DATA_FOUND
                           THEN
                              ejecutar := FALSE;
                              error_msg :=
                                    'NO SE ENCONTRO EL OPERADOR SIN BAJA CON CUIT: '
                                 || lote_migra.cuit;
                              DBMS_OUTPUT.put_line (error_msg);
                        END;
                  END;
            END;
         END IF;

         IF (ejecutar = TRUE)
         THEN
            BEGIN
               INSERT INTO siym.reg_lotes_operadores
                           (idoperador, idlote, fecha_alta
                           )
                    VALUES (idoperador, siym.reg_lotes_seq.CURRVAL, SYSDATE
                           );

               DBMS_OUTPUT.put_line
                      (   'SE INSERTO EN REG_LOTES_OPERADORES ** idoperador: '
                       || idoperador
                       || ' ** idlote: '
                       || siym.reg_lotes_seq.CURRVAL
                      );
            EXCEPTION
               WHEN OTHERS
               THEN
                  ejecutar := FALSE;
                  DBMS_OUTPUT.put_line
                                     ('NO SE INSERTO EN REG_LOTES_OPERADORES');
                  error_msg :=
                     'Exception others en reg_lotes_operadores => '
                     || SQLERRM;

                  BEGIN
                     INSERT INTO siym.reg_lotes_no_operadores
                                 (idlote,
                                  cuit, error
                                 )
                          VALUES (siym.reg_lotes_seq.CURRVAL,
                                  lote_migra.cuit, error_msg
                                 );

                     DBMS_OUTPUT.put_line
                                      ('SE INSERTO EN REG_LOTES_NO_OPERADORES');
                  EXCEPTION
                     WHEN OTHERS
                     THEN
                        ejecutar := FALSE;
                        DBMS_OUTPUT.put_line
                                  ('NO SE INSERTO EN REG_LOTES_NO_OPERADORES');
                  END;
            END;
         ELSE
            BEGIN
               /*error_msg :=
                     'Entra por el ELSE cuando no encontro operador con el cuit => '
                  || lote_migra.cuit;*/
               INSERT INTO siym.reg_lotes_no_operadores
                           (idlote, cuit,
                            error
                           )
                    VALUES (siym.reg_lotes_seq.CURRVAL, lote_migra.cuit,
                            error_msg
                           );

               DBMS_OUTPUT.put_line ('SE INSERTO EN REG_LOTES_NO_OPERADORES');
            EXCEPTION
               WHEN OTHERS
               THEN
                  ejecutar := FALSE;
                  DBMS_OUTPUT.put_line
                                  ('NO SE INSERTO EN REG_LOTES_NO_OPERADORES');
            END;
         END IF;
      /*ELSE
         BEGIN
            INSERT INTO siym.reg_nomig_lotes
                 VALUES (lote_migra.cuit, lote_migra.domicilio,
                         lote_migra.provincia, lote_migra.depto,
                         lote_migra.municipio, lote_migra.seccion,
                         lote_migra.dir_catastral, lote_migra.nro_lote,
                         lote_migra.sup_total, lote_migra.sup_cultivada,
                         lote_migra.anio_implementacion,
                         lote_migra.fecha_alta, lote_migra.observaciones,
                         error_msg);

            DBMS_OUTPUT.put_line
               (   'SE INSERTO EL REGISTRO EN REG_NOMIG_LOTES -> CATASTRAL: '
                || lote_migra.dir_catastral
                || ' -> NRO LOTE: '
                || lote_migra.nro_lote
               );
            ejecutar := TRUE;
         EXCEPTION
            WHEN OTHERS
            THEN
               ejecutar := FALSE;
               DBMS_OUTPUT.put_line
                  (   'NO SE INSERTO EL REGISTRO EN REG_NOMIG_LOTES -> CATASTRAL: '
                   || lote_migra.dir_catastral
                   || ' -> NRO LOTE: '
                   || lote_migra.nro_lote
                  );
         END;
      END IF;*/

      COMMIT;
   END LOOP;

   DBMS_OUTPUT.put_line
      ('********************* FIN DE PROCESO DE MIGRACION **********************'
      );
   COMMIT;
END;

CREATE OR REPLACE procedure prd_habi07 as
cursor c_notas is SELECT idoperador from siym.reg_operadores WHERE inhabilitado = 1;
v_inhabilitaciones integer;
begin update siym.reg_inhabilitaciones set fecha_habilitacion = to_timestamp(to_char(sysdate+1,'DD-MM-RRRR')), idusuario_habilita = 92 where fecha_habilitacion is null and fecha_notificacion is not null and months_between(trunc(sysdate,'MONTH'),trunc(add_months(fecha_notificacion, 1), 'MONTH')) >= 1 and idoperador in ( select idoperador from siym.reg_operadores where idtipo_operador not in (6,8,10) ) AND idmotivo_inhab IN (5,6);
for nota in c_notas LOOP SELECT COUNT(idoperador) INTO v_inhabilitaciones from siym.reg_inhabilitaciones WHERE idoperador = nota.idoperador AND fecha_habilitacion IS NULL AND idmotivo_inhab NOT IN (5,6);
IF v_inhabilitaciones = 0 THEN SELECT COUNT(idoperador) INTO v_inhabilitaciones FROM SIYM.reg_inhabilitaciones WHERE idoperador = nota.idoperador and fecha_habilitacion is null and fecha_notificacion is not null and months_between(TRUNC(sysdate,'MONTH'),trunc(add_months(fecha_notificacion, 1), 'MONTH')) >= 1 AND idmotivo_inhab IN (5,6); END IF;
IF v_inhabilitaciones = 0 THEN UPDATE SIYM.reg_operadores SET inhabilitado = 0 WHERE idoperador = nota.idoperador; end if; end loop; END PRD_HABI07;

View.Sql:
SELECT IDOPERADOR, ADD_MONTHS(MIN(TO_DATE(DECODE(SIGN(TO_DATE(PERIODO,'DD/MM/YYYY') - TO_DATE( '01/07/2010','DD/MM/YYYY')), -1, TO_DATE( '01/07/2010','DD/MM/YYYY'), TO_DATE(PERIODO,'DD/MM/YYYY') ) , 'dd/mm/yyyy')), 2) PERIODO , SIYM.REG$_OPERADORES."CUIT EMPRESA", SIYM.REG$_OPERADORES."TIPO DE OPERADOR", SIYM.REG$_OPERADORES."RAZON / DENOMINACION SOCIAL" FROM ( SELECT IDOPERADOR, TO_CHAR(MIN(PERIODO),'dd/mm/yyyy') PERIODO FROM ( SELECT "SIYM"."EXP_NOTA_FUERA"."IDOPERADOR", "SIYM"."EXP_NOTA_FUERA"."PERIODO", MAX("SIYM"."EXP_NOTA_FUERA"."FECHA") FECHA, MAX("SIYM"."EXP_NOTA_FUERA"."FECHA_PAGO") PAGO FROM "SIYM"."EXP_NOTA_FUERA" WHERE ("SIYM"."EXP_NOTA_FUERA"."IDOPERADOR",
"SIYM"."EXP_NOTA_FUERA"."PERIODO") NOT IN ( SELECT "SIYM"."EXP_NOTA_FPRESPRES"."IDOPERADOR", "SIYM"."EXP_NOTA_FPRESPRES"."PERIODO" FROM "SIYM"."EXP_NOTA_FPRESPRES"
) AND ("SIYM"."EXP_NOTA_FUERA"."IDOPERADOR",
"SIYM"."EXP_NOTA_FUERA"."PERIODO") NOT IN ( SELECT "SIYM"."EXP_NOTA_ANULA"."IDOPERADOR", "SIYM"."EXP_NOTA_ANULA"."PERIODO" FROM "SIYM"."EXP_NOTA_ANULA"
WHERE "SIYM"."EXP_NOTA_ANULA"."IDTIPO_ESCRITO"=1 ) GROUP BY "SIYM"."EXP_NOTA_FUERA"."IDOPERADOR", "SIYM"."EXP_NOTA_FUERA"."PERIODO", "SIYM"."EXP_NOTA_FUERA"."FECHA_PAGO" ) WHERE PAGO IS NULL GROUP BY IDOPERADOR
UNION SELECT "SIYM"."EXP_NOTA_NOPRES"."IDOPERADOR" IDOPERADOR, TO_CHAR(MIN("SIYM"."EXP_NOTA_NOPRES"."PERIODO"), 'dd/mm/yyyy') PERIODO --"SIYM"."EXP_NOTA_NOPRES"."PERIODO" FROM "SIYM"."EXP_NOTA_NOPRES" WHERE ("SIYM"."EXP_NOTA_NOPRES"."IDOPERADOR", "SIYM"."EXP_NOTA_NOPRES"."PERIODO") NOT IN ( SELECT "SIYM"."EXP_NOTA_PRES"."IDOPERADOR", "SIYM"."EXP_NOTA_PRES"."PERIODO" FROM "SIYM"."EXP_NOTA_PRES"
) AND ("SIYM"."EXP_NOTA_NOPRES"."IDOPERADOR", "SIYM"."EXP_NOTA_NOPRES"."PERIODO") NOT IN ( SELECT "SIYM"."EXP_NOTA_FUERA"."IDOPERADOR", "SIYM"."EXP_NOTA_FUERA"."PERIODO" FROM "SIYM"."EXP_NOTA_FUERA"
) AND ("SIYM"."EXP_NOTA_NOPRES"."IDOPERADOR", "SIYM"."EXP_NOTA_NOPRES"."PERIODO") NOT IN ( SELECT "SIYM"."EXP_NOTA_ANULA"."IDOPERADOR", "SIYM"."EXP_NOTA_ANULA"."PERIODO" FROM "SIYM"."EXP_NOTA_ANULA"
WHERE "SIYM"."EXP_NOTA_ANULA"."IDTIPO_ESCRITO"=2 ) GROUP BY "SIYM"."EXP_NOTA_NOPRES"."IDOPERADOR"
)
INNER JOIN SIYM.REG$_OPERADORES ON ( IDOPERADOR=SIYM.REG$_OPERADORES."NRO DE OPERADOR" ) GROUP BY IDOPERADOR, SIYM.REG$_OPERADORES."CUIT EMPRESA", SIYM.REG$_OPERADORES."TIPO DE OPERADOR", SIYM.REG$_OPERADORES."RAZON / DENOMINACION SOCIAL" ORDER BY IDOPERADOR
